(2, 'Retroalimentacin Caja', 'Lady Johana Snchez', '<p>Refuerzo para la contabilizacin de los ingresos y las salidas de caja en los CO.</p>', '2023-03-15', 2, 187),
(3, 'Prueba capacitacion', 'Stefannia Marin', '<p>Prueba&nbsp;</p>', '2023-04-14', 1, 10),
(4, 'CUTMASTER 2D', 'Diana Marcela Mora Cardona', 'Explicar el funcionamiento y las herramientas del sofware CutMaster 2D.', '2023-04-17', 1, 4),
(6, 'DAVIPLATA', 'Lady Johana Snchez', '<p>Dar a conocer un nuevo medio de pago para facilidad de los clientes.<br></p>', '2023-06-27', 2, 187),
(7, 'INCOCREDITO-RETROALIMENTACIN', 'Lady Johana Snchez', '<p>Tips de seguridad para el buen manejo de las transacciones realizadas en el Datafono con Tarjeta DB o CR.</p>', '2023-06-27', 2, 187),
(8, 'FUNCIONAMIENTO DATAFONOS MINIPRO', 'Lady Johana Snchez', '<p>Recordar a todos los encargados sobre el debido manejo del Datfono MINIPRO de Redeban.</p>', '2023-07-31', 2, 187),
(9, 'Comunicacin Efectiva', 'Sandra Milena Gonzales | Maria del Pilar Orrego', '<p>Esta capacitacion tiene como objetivo fomentar los habitos y habilidades que contribuyan mejorar la comunicacion en la organizacion</p>', '2023-08-16', 2, 169),
(10, 'TU MUEBLE EN MELAMINA', 'Julin Rodrguez ', '<p>TEMARIO<br aria-hidden=\"true\">\r\n        <br aria-hidden=\"true\">\r\n        - Introduccin a la carpintera en\r\n          melamina.<br aria-hidden=\"true\">\r\n        - Tableros y materiales laminados.<br aria-hidden=\"true\">\r\n        - Instalacin de programas SketchUp\r\n          y optimizado.<br aria-hidden=\"true\">\r\n        - Introduccin SketchUp.<br aria-hidden=\"true\">\r\n        - Tomar medidas.<br aria-hidden=\"true\">\r\n        - Diseo y despiece de cocinas\r\n          integrales (Archivos digitales de cascos pre diseados).<br aria-hidden=\"true\">\r\n        - Diseo y despiece de clset y\r\n          Vestier (Archivos digitales clset pre diseado).<br aria-hidden=\"true\">\r\n        - Diseo y despiece mueble TV\r\n          (Archivos digitales).<br aria-hidden=\"true\">\r\n        - Costos y presupuestos.<br aria-hidden=\"true\">\r\n        - Herramientas y elementos gua.<br aria-hidden=\"true\">\r\n        - Tornillera y herrajes.<br aria-hidden=\"true\">\r\n        - Prctica tipos de ensamble.<br aria-hidden=\"true\">\r\n        - Prctica instalacin de distintos\r\n          herrajes.<br aria-hidden=\"true\">\r\n        - Prctica armemos un mueble en\r\n          melamina.&nbsp;</p>', '2023-09-15', 1, 4),
(11, 'RECURSOS HUMANOS', 'SALOMN HINOJOSA COBALEDA', '<p>VISIN- MISIN- POLTICAS- IDNETIDAD DE MARCA- ESCALAS Y COMISIONES&nbsp;</p>', '2023-11-29', 2, 3);
