INSERT INTO `concepto_retiro` (`id_concepto`, `causalidad_retiro`, `concepto_retiro`, `fecha_retiro`, `numero_caja`, `fecha_registro`, `fecha_modificacion`, `usuarios_id_usuario`) VALUES
(1, 'VOLUNTARIO', 'Voluntario sin previo aviso por motivos de ndole familiar que lo obligaron a desocupar su sitio de residencia de forma imprevista.  - Leidy Cristina Pulgarin Gallego', '2023-01-10', '1', '2023-01-30', NULL, 166),
(2, 'VOLUNTARIO', '', '2022-09-09', '1', '2023-01-30', NULL, 175),
(3, 'VOLUNTARIO', '', '2022-12-09', '1', '2023-01-30', NULL, 163),
(4, 'OTRA', 'Renuncia Voluntaria,  Se retir unos das antes de que le reconocieran la pensin por vejez  debido a que tena programado un viaje a Europa para visitar a sus 2 hijas que tuvieron bebe.\r\n\r\nSe destac por su gran sentido de perteneca y gratitud con la empresa, compromiso, responsabilidad, por ser muy colaborador, servicial y respetuoso con sus compaeros, siempre muy dispuesto a ayudar en la seccin que lo requeran. - Leidy Cristina Pulgarin Gallego', '2022-06-24', '37', '2023-03-14', NULL, 46),
(5, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Renuncia Voluntaria,  Se retir unos das antes de que le reconocieran la pensin por vejez  debido a que se senta muy enfermo y que mientras comienza a recibir la mesada pensional los hijos estarn a cargo de los gastos de hogar. - Leidy Cristina Pulgarin Gallego', '2022-06-30', '37', '2023-03-14', NULL, 55),
(6, 'VOLUNTARIO', 'El trabajador desempaaba labores en la Mquina Enchapadora de Cantos, manifest tener dolencia en las manos, sin haber sufrido un accidente en el trabajo y llevar menos de tres meses en la empresa, por lo que fue a la IPS Los Rosales diciendo que el dolor fue contrado en la empresa y empez a diagnosticar todo como si fuera de origen laboral, abandon su puesto, despus de una incapacidad. Despus de haber recibido un correo comunicndole que lo que estaba haciendo era abandono de puesto sin justificacin alguna, se le realizara terminacin de contrato, volvi a la empresa solicitando una suma exagerada para que le reconocieran la supuesta enfermedad laboral que haba adquirido en el poco tiempo que manej la enchapadora. Finalmente conciliaron un acuerdo y posteriormente renunci. - Leidy Cristina Pulgarin Gallego', '2022-06-10', '37', '2023-03-14', NULL, 51),
(7, 'VOLUNTARIO', 'Renuncia voluntaria por temas personales, se siente enfermo, con migraa y va a solicitar citas mdicas y a realizarse exmenes para revisar cual es el problema que tiene, que primero la salud, quiere descansar un poco debido a que ms adelante su padre lo va ayudar para llevrselo para Estados Unidos. El lder de tapicera le llam varias veces la atencin en el terminado del tapizado debido a que dejo pasar varios muebles con problemas de calidad y los devolvieron de la Bodega Principal. - Leidy Cristina Pulgarin Gallego', '2022-05-31', '37', '2023-03-14', NULL, 87),
(8, 'VOLUNTARIO', 'Renuncia voluntaria, le iba muy bien en el proceso pero por la parte salarial no se acoplo, deca que no importaba que este fuera un trabajo estable y con todas sus prestaciones, que l estaba enseado a recibir ms dinero y en otro lado le iban a pagar mucho mejor, su aspiracin salarial era ms de $1.600.000. - Leidy Cristina Pulgarin Gallego', '2022-07-05', '38', '2023-03-14', NULL, 190),
(9, 'VOLUNTARIO', 'Renuncia Voluntaria,  mejor oferta laboral de $1.500.000 en un molinero, estaba reubicado como pintor pero no le estaba yendo bien en el proceso. - Leidy Cristina Pulgarin Gallego', '2022-07-08', '38', '2023-03-14', NULL, 54),
(10, 'VIAJE A OTRO PAIS', 'Renuncia Voluntaria, tuvo un alto nivel de ausentismo, viaje a EE.UU. para vivir con la mam. - Leidy Cristina Pulgarin Gallego - Leidy Cristina Pulgarin Gallego', '2022-07-15', '38', '2023-03-14', NULL, 72),
(11, 'VOLUNTARIO', 'Renuncia voluntaria, desea trabajar en lo que estudi, solicit aumento de salario pero no fue autorizado, su situacin familiar es muy compleja debido a que su padrastro esta en silla de ruedas y su hermana perdi un ojo en un accidente y necesita viajar con ella a unos exmenes a Ibagu para acompaarla, entonces tambin requiere disponibilidad de tiempo para estos trmites. Fue muy respetuosa y responsable con su trabajo. - Leidy Cristina Pulgarin Gallego', '2022-08-12', '38', '2023-03-14', NULL, 83),
(12, 'VOLUNTARIO', 'Renunci por motivos personales, informo que se cambi de ciudad que se fue a vivir a Armenia, falt varios das sin excusa, hasta que informo que se iba a retirar, fue necesario contactar a varios de sus familiares para enviarle la razn de que viniera a legalizar su renuncia, es muy irresponsable. - Leidy Cristina Pulgarin Gallego', '2022-08-31', '38', '2023-03-14', NULL, 198),
(13, 'TERMINACION DE CONTRATO', 'Terminacin contrato por su mal desempeo laboral, debido a que a pesar de ser ubicado en diferentes actividades en la planta de produccin, su eficiencia no fue buena y no mejor a pesar de la retroalimentacin que se le realiz donde se le solicitaba ms concentracin en las tareas asignadas, para as garantizar una mejor calidad en los productos y continuaba cometiendo los mismo errores, no tena buena aptitud dirigida hacia la mejora. Tambin se le realiz un llamado de atencin en jun/22 por haber solicitado un permiso para acompaar a su padre en una ciruga, pero su pudo evidenciar que minti debido a que al otro da no entreg ningn documento para soportar su ausencia. - Leidy Cristina Pulgarin Gallego', '2022-09-01', '38', '2023-03-14', NULL, 191),
(14, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Retiro Voluntario, se retiro 15 das antes de recibir su primera mesada pensional, manifestando que debia realizar unos tramites de  caracter personal, fue muy respetuoso, se le llam la atencin debido a que estaba utilizando el celular en horario laboral en el bao, como tena restricciones mdicas, las actividades que desempeaba en Tapicera eran muy basicas. ejm: armar esquineros. - Leidy Cristina Pulgarin Gallego\n\nDespus de que se retiro estuvo realizando malos comentarios de la empresa, que aqui los querian tenerlos como esclavos con respecto a los tiempos que se les exigiian. Manifest tambin que varias personas que informaron entre ellas (Robinson Mena (Tapicera) - Bryan Loiaza (Maquinado). que se retiraban debido a que se iban del pais en realidad se fueron a trabajar en realidad a Audifarma que es donde trabaja su hijo. - Edith Betancourt Betancourt', '2022-09-15', '38', '2023-03-14', NULL, 57),
(15, 'VOLUNTARIO', 'Retiro voluntario, debido a que es cabeza de familia, tiene 2 hijos (15 y 4 aos) que dependen econmicamente de ella, tiene a su ex-esposo demandando por alimentos y su madre quien le cuidaba el hijo menor de 4 aos, le inform que se va a ir varios meses para Chile,  entonces Liliana va a emprender un negocio desde su casa. \r\n\r\nSu desempeo fue muy bueno, es muy respetuosa y comprometida, le apasiona las mquinas de coser, era la persona idnea para reparar servicios tcnicos o realizar trabajos especiales de costura, inclusive tiene un tatuaje en su cuerpo de una mquina. La Ing. Viviana le informo que si su mam regresaba de Chile y estaba interesada en reingresar que le notificara. - Leidy Cristina Pulgarin Gallego\n\nFinalmente nos enteramos que se fua a trabajar  en una empresa que maquila para Adidas y Nike y que tiene mejores ingresos. - Edith Betancourt Betancourt', '2022-09-16', '38', '2023-03-14', NULL, 27),
(16, 'INDEPENDIENTE', 'Renuncia voluntaria, Informa que es tcnico de motos y que va a independizar, va a montar su propio taller de reparacin de motos. Tuvo un buen desempeo laboral. - Leidy Cristina Pulgarin Gallego', '2022-09-30', '38', '2023-03-14', NULL, 76),
(17, 'ESTUDIOS', 'Retiro Voluntario, manifiesta que estaba amaado en el trabajo, pero su decisin obedece a que seguir estudiando, ingresar al Sena de D/das. a estudiar Mecatrnica y tambin Ingls, informa que tiene 18 aos y sus padres lo van a apoyar para que pueda continuar con sus estudios. - Leidy Cristina Pulgarin Gallego', '2022-10-07', '38', '2023-03-14', NULL, 197),
(18, 'TERMINACION DE CONTRATO', 'Su desempeo fue bueno, Se aline a los objetivos de la prctica realizando apoyo en programacin y manejo CNC, desarrollo mantenimientos preventivos y correctivos de CNC y enchapadora de cantos.  Tuvo un punto dbil fue en las llegadas a tiempo, en lo cual se le hizo mucho nfasis y tambin qued plasmado en la evaluacin de prcticas de la UTP. - Leidy Cristina Pulgarin Gallego', '2022-10-11', '38', '2023-03-14', NULL, 34),
(19, 'TERMINACION DE CONTRATO', 'Se le entreg carta de terminacin contrato por sus ausencias injustificadas y falta de compromiso con la empresa. Manifesto que la iba a hacer revisar la carta de un abogado que porque su contrato se vencia era en febrero de cada ao, se valid el tema con don Salomn (Gerente de Talento Humano) y la fecha en que fue entregada la carta estaba dentro del marco legal, debido a que el contrato a termino fijo fue pactado a 11 meses inferior a un ao.\r\n\r\nFue muy irresponsable, evada las causas por las cuales dejaba su trabajo, sus problemas personales con su pareja le afectaban notablemente su despeo laboral, debido a que no era capaz de controlar sus emociones. Das despus renunci de forma voluntaria manifestando que tena otro empleo. - Leidy Cristina Pulgarin Gallego', '2022-10-14', '38', '2023-03-14', NULL, 15),
(20, 'VIAJE A OTRO PAIS', 'Retiro voluntario por motivo de viaje a Chile donde vive su mam, su desempeo fue muy bueno. - Leidy Cristina Pulgarin Gallego', '2022-10-18', '38', '2023-03-14', NULL, 196),
(21, 'VOLUNTARIO', 'No continu vinculado a la empresa debido a que entreg 1 Certificado de Incapacidad Falso de la NUEVA EPS, manifest que es primo de Brallan Berjan y que fue l quien le informo que ya haba entregado una incapacidad falsa y le enseo como hacerla; reconoce que es una falta grave, que estaba amaado en la empresa pero que tiene que pagar por las consecuencias de sus actos y por dejarse influenciar de primo para realizar este acto tan deshonesto. - Leidy Cristina Pulgarin Gallego', '2022-10-20', '38', '2023-03-14', NULL, 209),
(22, 'VOLUNTARIO', 'No continu vinculado a la empresa debido a su alto ndice de ausentismo, falt varias veces sin justa causa informando que la mam sufre de diabetes, no entreg ningn soporte y tampoco se comunic con la empresa, fue suspendido 2 das por este motivo, adems y ms grave an entreg 2 Certificados de Incapacidad Falso de la NUEVA EPS, por tal motivo se confront y reconoci su grave falta. es primo de Jhon Wberly - Leidy Cristina Pulgarin Gallego', '2022-10-20', '38', '2023-03-14', NULL, 45),
(23, 'VOLUNTARIO', 'Renuncia Voluntaria, manifest que no estaba teniendo una buena relacin con el equipo de lderes de trabajo y que senta que todos los inconvenientes de produccin lo sealaban a l como culpable, quizs por ser un lder ms nuevo y pues que ya no estaba durmiendo bien, que adems manejar personal es muy complejo y que le result una mejor oferta laboral donde comenzar a partir de nov/22 y que ms o menos en 2 aos desea regresar a Venezuela para manejar un taxi de la familia. Gustavo Ortiz (Asitente de Pccin) me informo que Edixon quera que todo saliera perfecto en produccin y ese mundo ideal no existe, que deben se muy flexibles y saberle dar manejo a los imprevistos de cada da, cuando ingreso a la empresa tena muy buena actitud e inicitiativa para elaboracin de plantillas pero era muy desordenado con su trabajo. - Leidy Cristina Pulgarin Gallego', '2022-10-31', '38', '2023-03-14', NULL, 16),
(24, 'VOLUNTARIO', 'Renuncia Voluntaria, debido a que solicit un permiso o que le liquidaran vacaciones por motivo de viaje a Francia - Europa  por 2 meses y medio para visitar a una hermana y familiares que tiene all, y no fue viable su solicitud. Se le informo a Edward que si regresa al pais y hay vacantes puede concursar nuevamente para vincularse a la empresa sin ningn compromiso; su desempeo fue bueno, es muy respuetuoso. - Leidy Cristina Pulgarin Gallego', '2022-11-11', '38', '2023-03-14', NULL, 43),
(25, 'TERMINACION DE CONTRATO', 'Terminacin contrato, por bajo rendimiento, se le realiz llamado de atencin por las continuas llegadas tarde al trabajo, tenia problemas de disciplina, charlaba mucho con sus compaeros en horario laboral lo cual afectaba su desempeo y productividad, no se esforzaba por mejorar en los puntos retroalimentados por  los lideres ( tiempos y tareas asignadas. - Leidy Cristina Pulgarin Gallego - Sistemas Muebles Albura', '2022-05-02', '37', '2023-03-14', NULL, 44),
(26, 'VOLUNTARIO', 'Terminacin contrato, por bajo rendimiento laboral, se distraia con facilidad. - Leidy Cristina Pulgarin Gallego', '2022-05-12', '37', '2023-03-14', NULL, 18),
(27, 'TERMINACION DE CONTRATO', '\n\nSe defini su contrato en periodo de prueba debido al alto nivel de ausentismo, ingres el 2 de noviembre y ya tena 3 incapacidades, adems tuvo un mal desempeo laboral. - Leidy Cristina Pulgarin Gallego', '2022-11-21', '39', '2023-03-14', NULL, 222),
(28, 'VOLUNTARIO', '\n\nConcepto emitido por la Fbrica: Renuncia Voluntaria, debido a que se fue a vivir a Costa Rica con los hijos y el esposo, all tiene una hermana y un hermano, lo que ella expone es que por ac le toca muy duro porque el papa de los nios no le ayuda mucho con ellos ( no es su pareja actual) y que los nios permanecen prcticamente solos, porque su mam solo va y les da el desayuno y el almuerzo, y ella no puede estar muy pendiente de ellos dice que por all si trabajara pero no unas jornadas tan largas entonces puede estar ms pendiente de ellos. Su desempeo fue bueno. - Leidy Cristina Pulgarin Gallego', '2022-12-30', '39', '2023-03-14', NULL, 58),
(29, 'VOLUNTARIO', '\n\nConcepto Emitido por la fbrica: Retiro Voluntario, estaba buscando cambiar de empleo debido a que no se conect con las actividades de la empresa, a pesar que estaba reubicada en tapicera haciendo diversas labores, como auxiliar de costura, mesa de corte, espumados, desbaratada de servicios tcnicos, pero no se adapt al proceso. Su desempeo fue bueno. - Leidy Cristina Pulgarin Gallego', '2022-12-30', '39', '2023-03-14', NULL, 224),
(30, 'VOLUNTARIO', '\n\nConcepto emitido por la Fbrica: Retiro Voluntario, por viaje a Chile donde vive su ta hace 7 aos, pens mucho en tomar la decisin dice que casi un ao, porque por la empresa el viva muy motivado cerca a su casa, sin trabajar los sbados pero puso sobre la balanza y su familia le ayud a tomar la decisin, dice que llega con trabajo en una empresa de baldosas en el rea logstica. Su desempeo fue excelente.\r\nLuego nos enteramos que en realidad no viajo a Chile, sino que se fue a trabajar a la fbrica de arepas del hijo del seor Javier Jaramillo (retirado por pensin) aqui en Dosquebradas.\r\n\r\nSe habl con l dos veces y se le dijo que reconsidera su decisin, pero nos ca con mentiras y se fue a trabajar a Audifarma que es donde trabaja el hijo del seor Javier Jaramillo. - Leidy Cristina Pulgarin Gallego', '2022-12-30', '39', '2023-03-14', NULL, 90),
(31, 'VOLUNTARIO', '\n\nConcepto emitido por la FABRICA: Renuncia voluntarria, Inform que estaba amaado en la empresa,que hay un buen ambiente laboral y que es debido a que se va a reintegrar a su empleo anterior donde trabajan carpintera para edificios de la Constructora CFC, el cual queda por los lados de la Postrera, trabajar solo hasta las 3 p.m y es ms cerca a Santa Rosa y que aqu se le dificulta ms el transporte de regreso para su casa, que a veces le dan las 7:30 p.m sin poder abordar la buseta y le da miedo manejar moto y que adems a su esposa le van a realizar una ciruga delicada de la matriz entonces que a l le toca despacharse su comida y tambin cuidarla a ella en su recuperacin de la operacin.\r\n\r\nJhon Jairo manifest que le gusta quedar con las puertas abiertas por si ms adelante se dan las cosas para volver, que por eso est renunciando con tiempo, pero la Jefe de Produccin notifica que tenia bajo rendimiento en su trabajo (De una Calificacin de 1 a 10 le otorg un 4), tambin se program para que trabajara el  17/dic/22 Horas Extras y no se present y tampoco inform que no podia venir, le falt compromiso. - Leidy Cristina Pulgarin Gallego', '2022-12-30', '39', '2023-03-14', NULL, 63),
(32, 'VOLUNTARIO', '\n\nConcepto Emitido por la Fbrica: Retiro voluntario, manifestando que viajar para Ecuador, el rendimiento fue regular (en una calificacin de 1 a 5 siendo 1 el ms bajo sera un 3, debido a que fue muy demorado en los tiempos). - Leidy Cristina Pulgarin Gallego', '2023-01-02', '39', '2023-03-14', NULL, 199),
(33, 'TERMINACION PRACTICA APRENDIZ', 'Termin su prctica Universitaria, presto apoyo en la seccin de maquinado operando la mquina CNC y estaba asignado al departamento de mantenimiento; era concreto con lo que se le asignaba, no se observ que buscara que hacer, tocaba mantenerlo programado, pero en general realizaba lo programado. - Edith Betancourt Betancourt - Leidy Cristina Pulgarin Gallego', '2023-01-04', '39', '2023-03-14', NULL, 195),
(34, 'VOLUNTARIO', '\n\nNo continuo vinculado a la empresa, debido a su alto indice de ausentismo, su desempeo fue bueno pero es claro que su evolucin en cuanto a aspectos discipiliarios de cumplimiento es deficiente y perturba los programas de produccin que previamente se han planificado.\r\n\r\nSe le realiiz evaluacin de desempeo y posteriormente tomo la decisin de renunciar de forma voluntaria. - Edith Betancourt Betancourt', '2023-01-06', '39', '2023-03-15', NULL, 212),
(35, 'BAJA PRODUCTIVIDAD', 'Retiro voluntario, debido a que se molest porque le llamaron la atencin debido a que estaba charlando con sus compaeros en horario laboral y tambin le molestaba la presin que tenia con el tema del control de los tiempos para trabajar en produccin.\r\n\r\nSu desempeo fue bueno, pero hubiera sido mejor si mejoraba sus actos de indisciplina, conversaba mucho con sus compaeros de trabajo. \r\n\r\nSe retir el 13 viernes y el lunes 16 envi mensaje por whatsapp a la administradora reclamando que porque no le haban pagado los das de esta quincena y que si le bamos a pagar por cada da de retraso.  - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-01-13', '39', '2023-03-15', NULL, 59),
(36, 'VOLUNTARIO', '\n\nRetiro voluntario, por regreso a Venezuela, su desempeo fue muy bueno a pesar de llevar poco tiempo en el proceso, era muy gil y le cogi facilmente el ritmo al trabajo. - Edith Betancourt Betancourt', '2023-01-13', '39', '2023-03-15', NULL, 211),
(37, 'ESTUDIOS', '\n\nRenuncia voluntaria, por motivo de estudio ya que debe terminar materias y trabajo de grado este semestre en la universidad en jornada diurna, su desepeo fue muy bueno. - Edith Betancourt Betancourt', '2023-01-19', '39', '2023-03-15', NULL, 29),
(38, 'INDEPENDIENTE', 'PRIMER INGRESO DEL 21 DE ABRIL DE 2003 AL 02 DE FEBRERO DE 2019 - EL RETIRO FUE VOLUNTARIO (CRISTINA PG) - Leidy Cristina Pulgarin Gallego\n\nRenunci de forma voluntaria, debido a que va a Administrar uno de los negocios \"Parrillada\" en Ciudad Victoria, que compr su hijastra con el esposo, debido a que ellos viven en Per y necesita a una persona de Confianza para que les administre este local, porque la persona que tienen actualmente les est robando y  que ella va a ganar un poco ms de dinero. Finalmente nos enteramos que se fua a trabajar con Lililiana Garcia otra Costurera que trabaj en la empresa, que estan trabajando en una empresa que Maquila para Adidas y Nike y que tienen mejores ingresos.\r\n\r\nFue una empleada de mucha trayectoria y confianza en la empresa de 19 aos, se caracteriz por ser muy responsable con su trabajo, era un poco bipolar con respecto a su temperamento. - Edith Betancourt Betancourt', '2023-01-30', '39', '2023-03-15', NULL, 84),
(39, 'PENSION POR VEJEZ Y/O INVALIDEZ', '\n\nRetiro Voluntario debido a que aL finalizar el mes de enero/2023 recibi su primera mesada pensional. Se carateriz por ser muy colaborador, amable y respetuoso con su sus compaeros, con gran sentido de pertencia por la empresa. - Edith Betancourt Betancourt', '2023-01-30', '39', '2023-03-15', NULL, 28),
(40, 'MEJOR OFERTA LABORAL', 'TUVO VARIOS INGRESOS: DEL 09/10/2012 AL 31/12/2012 = SE LIQUID POR VACACIONES COLECTIVAS DE LA FABRICA.\r\nDEL 28/01/ 2013 AL 02/09/2019 Y EL ULTIMO INGRESO FUE DE 03/10/2019 AL 03/02/2023 - Leidy Cristina Pulgarin Gallego\n\nSe le llamo la atencin en varias oportunidades por escrito debido a que se distraa con facilidad con los dispositivos electrnicos (computador y celular) en actividades diferentes a las laborales. \r\n\r\nSolicit aumento de salario y la empresa revis su solicitud pero como no fue viable, l manifest que iba a renunciar en 5 das, debido a que le haba resultado otra oferta laboral. Las materias primas del almacn las tuvo que recibir el Auxiliar de Auditora debido a que su reemplazo alcanz a entrar solo la tarde en que l se retir; cuando se pudieron establecer las diferencias del inventario l ya no estaba para responder por ellas y por tal motivo se tuvieron que ajustar. \r\n\r\nOrlando solicito que le pagaran su liquidacin y que la empresa no le poda retrasar el pago de sus prestaciones sociales por las diferencias que tena con el inventario, asumiendo un comportamiento muy irresponsable, le falt gratitud con la empresa. - Edith Betancourt Betancourt', '2023-02-03', '39', '2023-03-15', NULL, 8),
(41, 'TERMINACION DE CONTRATO', '\n\nTerminacin contrato debido a que tuvo muchas inasistencias y no se le veia amor o dedicacin hacia el trabajo, era marrullero en temas de productividad, fue muy inestable con temas mdicos. Manifest que l ingres bien de salud y que iba a salir enfermo de la columna pero no tuvo ningn AT, por tal motivo se le enviaron a realizar los exmenes mdicos de retiro, tambin solicit copia de su contrato laboral para llevarsela a un abogado cuando se le entreg la carta de terminacin contrato. - Edith Betancourt Betancourt', '2023-02-25', '39', '2023-03-15', NULL, 192),
(42, 'VOLUNTARIO', '\n\nRetiro voluntario, manifest que como ya termin su carrera como administradora de empresas, desea buscar un empleo ms afn a lo que estudi, en trabajos administrativos y no de produccin. Tambin tena programado un viaje a la costa con su familia y la operacin de su hija debido a que es cabeza de familia.  La empresa tuvo la intencin de promoverla al cargo de Auxiliar de auditora en prximos meses y brindarle el permiso para acompaar a su hija a la ciruga, pero manifest que no poda esperar y que mejor se retiraba. Su desempeo fue bueno. - Edith Betancourt Betancourt\n\nCumpla los requerimientos del cargo de buena manera, mantena la documentacin al da, se le hizo en dos ocasiones la observacin sobre no entablar conversaciones largas con los operarios por el tema de los tiempos no aplicables y los tom de muy buena manera. - Edith Betancourt Betancourt', '2023-02-27', '39', '2023-03-15', NULL, 205),
(43, 'VIAJE A OTRO PAIS', 'Terminacin Contrato, se defini en periodo de prueba debido a que inform que solo podra trabajar hasta abril/23, puesto que viajar a Chile a cuidar a su hija que va a tener bebe, en la entrevista no manifest tener intenciones de viajar. La seora fue muy complicada durante sus pocos das de estada en la empresa, solicit una silla con rodachines, realiz varios cambios de dotacin de las botas por la talla, manifest tambin que ella no escucha la msica de la planta sino msica cristiana y tambin le realiz el comentario a una compaera de que aqu en la fbrica no se la iba a dejar montar de nadie. - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-02-06', '40', '2023-03-15', NULL, 245),
(44, 'VOLUNTARIO', 'Retiro Voluntario, falt al trabajo sin justa causas varias veces,  Inform que el horario de la fbrica no le favorece para realizar las diligencias de sus hijas y su mam, que el sbado no las alcanza a realizar todas y que adems no le gust pagar las horas del da que nos quedamos sin servicio de energa elctrica.  - Edith Betancourt Betancourt', '2023-03-08', '40', '2023-03-15', NULL, 241),
(45, 'OTRA', 'Retiro Voluntario. Se le entreg carta de terminacin contrato pero l decidi renunciar. Se le dificultaba entender y desarrollar actividades eficientemente inclusive las ms sencillas, no captaba bien las instrucciones, tuvo ausencias por incapacidades de 2 das c/u. - Edith Betancourt Betancourt', '2023-03-14', '1', '2023-03-27', NULL, 239),
(46, 'BAJA PRODUCTIVIDAD', 'Terminacin contrato en periodo de prueba, debido a sus continuas llegadas tarde, se le haba realizado un llamado de atencin por escrito, sin embargo continuo reincidiendo en esta situacin, adems las personas que lo direccionaron en el proceso, informaron que era muy pasivo y con poco ritmo de trabajo y a pesar que se le realiz nfasis en esto, hizo caso omiso de las sugerencias de mejora.  - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-03-15', '1', '2023-03-27', NULL, 248),
(47, 'MEJOR OFERTA LABORAL', 'Voluntario, debido a que comenzar a realizar las prcticas como Tecnlogo en Adm. de Empresas, pendiente definir por la Universidad de Comfamiliar y adems los horarios estn afectando sus estudios. Se valid su desempeo con la Jefe de Produccin y manifest que era muy hablador en las jornadas laborales y  no acat las observaciones que el Lder le realiz al respecto, cuando finalizaba la jornada laboral no respetaba la fila para salir. - Edith Betancourt Betancourt', '2023-03-30', '1', '2023-04-21', NULL, 97),
(48, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Retiro Voluntario por motivo de que le fue reconocida su pensin de Vejez, se caracteriz por ser un excelente compaero, muy conectado con los objetivos de la organizacin, con una energa de un joven de 15 aos, fue muy respetuoso y colaborador, siempre con la mejor actitud.  Tuvo varios periodos de ausentismo (accidentes de trabajo e incapacidades por enfermedad general). - Edith Betancourt Betancourt', '2023-03-31', '1', '2023-04-21', NULL, 81),
(49, 'MEJOR OFERTA LABORAL', 'Retiro Voluntario, debido a que comenzar a trabajar en una Ferretera por Cuba donde le pagarn $750.000 quincenalmente, como Auxiliar de Carga y debe trabajar los sbados. La Jefe de Produccin inform que ya se le haba realizado un ajuste salarial y solicit nuevamente otro ajuste, pero se le inform que se deba de capacitar primero en otras mquinas, comenz este proceso, pero no estaba teniendo un buen desempeo. - Edith Betancourt Betancourt', '2023-03-31', '1', '2023-04-21', NULL, 98),
(50, 'PROBLEMAS ECONOMICOS', 'Retiro Voluntario, manifiest que esta amaada en la empresa, pero que el salario no le alcanza para cubrir sus necesidades econmicas, debido a que est atrasada en el banco con varias cuotas y que necesita el dinero que tiene de las cesantas para pagar esta deuda. La empresa le realiz un anticipo a la liquidacin de $700.000 para que no renunciara el 11 de marzo/2023  sino que trabajara hasta fin de mes, tambin se le inform que poda refinanciar la deuda en el banco, pero ella manifiesto que si extenda el plazo, pagara ms dinero, y no estaba de acuerdo.  Su desempeo fue muy bueno.\r\n\r\nEra muy alegre, tenia buen rendimiento y conocimiento sobre las series, debido a los cambios de las costureras tom el liderazgo en la seccin, se le realizaron observaciones sobre no bailar en las reas de trabajo y de ciertas posturas cuando estaba capacitando a las compaeras y las tomo de buena manera. - Edith Betancourt Betancourt', '2023-03-31', '1', '2023-04-21', NULL, 35),
(51, 'MEJOR OFERTA LABORAL', 'Retiro Voluntario, manifest que tena sobrecarga laboral y un Contratista le estaba ofreciendo un salario de $1.500.000 para un trabajo en una obra de 10 aos. \r\n\r\nElla haba solicitado que vincularan a otra persona a travs de contrato de aprendizaje o laboral para que la apoyaran en su trabajo de forma provisional mientras la Coordinadora de SST se reintegraba de la licencia de maternidad, la empresa revis la solicitud y le inform que no era posible, se revisaron sus funciones y se redistribuyeron 15 y se le ofreci un bono provisional de $200.000, pero ella no acept la propuesta, confirmando el 14 de marzo su retiro.\r\n\r\nSu desempeo fue excelente, fue de gran apoyo administrativo, se caracteriz por manejar muy buenas relaciones interpersonales en la empresa, siempre estuvo con la mejor actitud para colaborar con lo que las diferentes reas y personas requeran citas mdicas e informacin.   - Edith Betancourt Betancourt', '2023-04-05', '1', '2023-04-21', NULL, 94),
(52, 'ESTUDIOS', 'Retiro Voluntario, debido a que estudio una tecnologa en Administracin de Empresas y quiere continuar con el ciclo Profesional y luego poder trabajar en lo que estudi. Se le realiz un proceso disciplinario con Acta de Descargos debido a que se ausent de la jornada laboral sin tener consentimiento ni autorizacin, debido a que el permiso se le haba negado por motivo de cierre de mes. - Edith Betancourt Betancourt', '2023-04-14', '1', '2023-04-21', NULL, 38),
(53, 'CUIDADO DE UN FAMILIAR', 'Solo trabaj 4 das, manifest que a su abuela le diagnosticaron cncer y como es un adulto mayor ella la va a cuidar en su tratamiento, cuando le estaban entregando el puesto de SST solicito el ltimo da que no le explicaran mas temas, al parecer ya haba tomado la decisin de renunciar.  - Edith Betancourt Betancourt', '2023-03-30', '1', '2023-04-21', NULL, 256),
(54, 'BAJA PRODUCTIVIDAD', 'Terminacin contrato, Debido a que fue muy rebelde y conflictivo, no generaba buen ambiente de trabajo, manifest que no iba a pagar el tiempo cuando se iba la energa y utilizaba el celular en el tiempo de pausas activas. - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-04-09', '1', '2023-04-21', NULL, 235),
(55, 'MOTIVACION', 'No estaba a gusto con el traslado de la Bodega 20 para la fbrica como operario de Tapicera. - Edith Betancourt Betancourt', '2023-05-03', '1', '2023-05-17', NULL, 259),
(56, 'MEJOR OFERTA LABORAL', 'Renunci por motivos econmicos, inform que no le alcanzaba el dinero para enviar a Venezuela, por tal motivo regresar a su anterior empleo REYCO (fbrica de Jeans), pero con mejores condiciones en la seccin de terminado.\r\n\r\nSe le realiz un llamado de atencin por reprocesos en la Molturadora, las observaciones que se le realizaron las tom de buena manera.\r\n\r\nSe promovi como Lder de Lija y Pintura y se devolvi a los 15 das como operario, debido a que no le fue bien en el proceso de anlisis y coordinacin.\r\n - Edith Betancourt Betancourt', '2023-05-12', '1', '2023-05-17', NULL, 210),
(57, 'BAJA PRODUCTIVIDAD', 'Se le realizo evaluacin de periodo y no fue apto para continuar en el proceso le falta mas dinamismo y compromiso con el trabajo, faltaba sin justa causa, tena alto grado de ausentismo.\r\nPresent un accidente de trabajo con contusin por golpe en su brazo. - Santiago Elias Murillo Henao - Edith Betancourt Betancourt', '2023-05-31', '1', '2023-06-21', NULL, 232),
(58, 'BAJA PRODUCTIVIDAD', 'Se le informo que no segua en el proceso por bajo rendimiento, y los compaeros, a los que se les practico la prueba del polgrafo, lo acusan por perdida del un Buril de la Maquina Torno Copiador, aunque no hay pruebas concretas de los hechos. - Santiago Elias Murillo Henao', '2023-05-31', '1', '2023-06-21', NULL, 26),
(59, 'BAJA PRODUCTIVIDAD', 'No ha logr mejorar los rendimientos de produccin, debe mejorar mucho la calidad, utiliza tiempo del horario del trabajo para otras actividades como el celular, a veces pide cambio en las actividades que est ejecutando aun siendo trabajos no complejos como un somier.\r\nSe le realizaron varios llamados de atencin verbal, uno de ellos fue en la sala de juntas con Edith, Santiago y Gustavo. - Santiago Elias Murillo Henao', '2023-06-01', '1', '2023-06-21', NULL, 261),
(60, 'BAJA PRODUCTIVIDAD', 'Es una persona que debe tener ms concentracin y agilidad en el proceso, debe mejorar la comunicacion y saber que informacin afecta el proceso, es insegura y por ello a veces se cometen errores. Le falta tener una vista ms global del proceso. - Santiago Elias Murillo Henao', '2023-06-30', '1', '2023-07-11', NULL, 31),
(61, 'BAJA PRODUCTIVIDAD', 'Por su tiempo en la empresa ya era tiempo que fuese ms gil en el proceso, que sea autnomo y no requiera continua supervisin, debe ser ms activo no ha pasado de ayudante o funciones de cargue y descargue. No se le pueden asignar tareas diferentes e importantes porque se queda corto en la ejecucin. - Santiago Elias Murillo Henao', '2023-06-30', '1', '2023-07-11', NULL, 22),
(62, 'BAJA PRODUCTIVIDAD', 'Es un chico con el que se tena muchas expectativas desde la entrevista porque es una persona decente y respetuosa, pero su dinamismo y eficiencia no se reflejan en el proceso, se ha realizado de manera individual y con el grupo de trabajo un proceso de concientizacin acerca de mejorar los resultados, se ha tenido en la oficina de produccin hablando de rendimientos pero finalmente esto no se ve reflejado en los resultados, las programaciones con l nunca se cumplen y quedan por debajo de un 60% y obviamente esto no es ptimo para los resultados que se requieren, no podemos dar ms tiempo de capacitacin. - Santiago Elias Murillo Henao', '2023-06-30', '1', '2023-07-11', NULL, 221),
(63, 'BAJA PRODUCTIVIDAD', 'Fue una persona que se quiso rescatar en el proceso, pero si analizamos el tema de eficiencias no est de acuerdo a los parmetros exigidos para alcanzar las metas de produccin, no se le pueden asignar tareas complejas en tapizado no alcanza los tiempos de produccin. Tiene muchas ausencias por motivos diferentes los cuales afectan duramente los tiempos de produccin. - Santiago Elias Murillo Henao', '2023-07-14', '1', '2023-07-17', NULL, 214),
(64, 'MEJOR OFERTA LABORAL', 'Es una persona educada, buen trabajador, a las tareas que se le asignan las toma de buena manera, tuvo un ausentismo debido a que tuvo problemas en un viaje de regreso de Medellin, el viaje fue a causa de la iglesia a la cual pertenece.\r\nEl retiro es a causa de una mejor oferta laboral, l a trabajado cortando caa y le volvi a resultar trabajo en el mismo sector pero ahora en el semillero y le pagaran mejor.\r\nLos ingresos que perciba en la empresa solo le alcanzaban a cubrir el 50% de los gastos de su casa. - Santiago Elias Murillo Henao', '2023-07-14', '1', '2023-07-17', NULL, 260),
