(85, 'TERMINACION PRACTICA APRENDIZ', 'Terminacin contrato de Aprendiz, fue muy buena en las actividades asignadas por el jefe directo, y saco varios proyectos adelante en el rea de diseo - Santiago Elias Murillo Henao', '2023-07-21', '1', '2023-07-25', NULL, 240),
(86, 'TERMINACION DE CONTRATO', 'No toma de buena manera las retroalimentaciones de sus compaeros, tuvo varios llamados de atencin verbales por no usar EPP y uno escrito, Tomo retales de madera, los pego, resano y les aplico laca transparente sin autorizacin y a escondidas lo cual evidencio su mala intencin, por lo cual, finalmente, se le dio terminacin al contrato. - Santiago Elias Murillo Henao', '2023-07-28', '1', '2023-08-02', NULL, 223),
(87, 'MAL AMBIENTE LABORAL', 'Se senta abrumada por el ambiente que generaba su compaera Mara Milena Ayala, sin embargo se le pregunt a Liz que si no comparta la misma rea de trabajo con Milena reconsideraba su decisin, a lo cual dijo que no. - Santiago Elias Murillo Henao', '2023-07-28', '1', '2023-08-02', NULL, 255),
(88, 'TERMINACION PRACTICA APRENDIZ', 'El motivo del retiro fue por finalizacin de sus prcticas, su desempeo fue bueno, realizo las actividades con buena actitud, es muy tranquilo y disciplinado. - Santiago Elias Murillo Henao', '2023-07-29', '1', '2023-08-22', NULL, 242),
(89, 'BAJA PRODUCTIVIDAD', 'SU RENDIMIENTO FUE BAJO, LA ACTITUD FRENTE A LAS INSTRUCCIONES RECIBIDAS NO ES BUENA  POR QUE SUS GESTOS SON DE PEREZA , ADEMS SE HA VISTO CON SUEO . POR OTRO LADO LUEGO DE TERMINAR UNA ACTIVIDAD NO BUSCA EL LIDER PARA UNA NUEVA ASIGNACIN DE TAREA , POR EL CONTRARIO SE QUEDA PERDIENDO TIEMPO. - Santiago Elias Murillo Henao', '2023-08-31', '1', '2023-09-06', NULL, 201),
(90, 'BAJA PRODUCTIVIDAD', 'YERALDINE ERA UNA CHICA QUE YA LLEVA EN EL PROCESO UN TIEMPO DONDE SE ESPERABA QUE FUERA MS ACTIVA, CON INICIATIVA PARA ACCIONES DE MEJORA Y EMPODERADA DEL TEMA, PERO NO VA MS ALL DE LO QUE SE LE PIDE, EL PROCESO CON ELLA ES MUY LINEAL. NO REALIZABA PLANES DE VERIFICACIN E INSPECCIN. NO CUMPLA CON LOS PARMETROS ESTIPULADOS EN PRO DE LA MEJORA Y  HABLABA MUCHO CON PERSONAS EN HORARIOS LABORALES.   - Santiago Elias Murillo Henao', '2023-08-31', '1', '2023-09-06', NULL, 48),
(91, 'OTRA', 'En un principio fue poco dinmico, se le realizaron varias observaciones las cuales tom en cuenta y se le vio mejora, sin embargo tom la decisin de retirarse para devolverse a Bogot con los Hermanos y resto de familiares. - Santiago Elias Murillo Henao - Edith Betancourt Betancourt', '2023-09-13', '1', '2023-09-15', NULL, 264),
(92, 'TERMINACION PRACTICA APRENDIZ', 'Es una persona que cumplio con sus actividades, sin embargo al principio se mostraba con pereza  en el trabajo y no le gusta quedarse quieto  - Santiago Elias Murillo Henao', '2023-08-19', '1', '2023-10-03', NULL, 249),
(93, 'OTRA', 'No continu vinculado a la empresa debido a que informo que su madre padeca un cncer severo y por tal motivo la empresa le facilit varios permisos remunerados, manifestando que su madre era beneficiaria del SISBEN y que l era el nico de 6 hermanos que estaba pendiente de ella, quien se encontraba en el Hospital San Jorge en el 4 piso; pero todo fue un engao, la empresa pudo verificar que su Madre es cotizante hace varios aos, por tal motivo se llam a relacin donde confeso que todo era falso y que l se encontraba en problemas familiares con su esposa quien lo traicion y se encontraba en proceso de separacin y que l no le encontraba sentido a vivir ms, sin embargo esta situacin no justifica sus mentiras. Su desempeo fue bueno, pero su comportamiento en cuanto a principios morales y ticos hacen referencia de que no es una persona confiable. - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-10-06', '1', '2023-10-24', NULL, 189),
(94, 'PROBLEMAS FAMILIARES', 'Se retir de forma voluntaria, manifest que no poda continuar vinculado a la empresa debido a que su hermano est en conflicto con unos vecinos del Barrio Tokio donde residen en Pereira y tienen amenazada a su familia y por tal motivo se va a trasladar con su mam y hermano para Medelln.\r\n\r\nSu desempeo fue bueno, se demor, pero finalmente se adapt al proceso, manejaba tiempos cerca al estndar. Se le realiz afectacin de nmina por faltar al trabajo sin justa causa debido a que se le solicitaba que presentara los soportes de ausencias pero no lo hizo, en una ocasin inform que la mama estaba enferma pero no present los documentos de su atencin - Edith Betancourt Betancourt', '2023-10-13', '1', '2023-10-24', NULL, 213),
(95, 'VIAJE A OTRO PAIS', 'Su retiro fue voluntario, se destac por su amabilidad y respeto, cuando ingres a la seccin de Tapicera como operario fue difcil adaptarse al proceso y tiempos, pero en la parte de terminado finalmente le empez a ir bien, se le llam varias veces la atencin en su conducta por charlar con los compaeros de trabajo y con la practicante de Diseo y Calidad Natalie, fue una conducta que finalmente logr mejorar. \r\n\r\nEn julio/23, fue promovido al cargo de auxiliar de auditora; se le realiz retroalimentacin sobre los aspectos a mejorar y expres su deseo de no continuar vinculado con la empresa, debido que tiene planes de irse a vivir a Espaa a finales de dic/23 para trabajar en la empresa de su ta. - Edith Betancourt Betancourt\n\nSolicito aumento de salario por su cambio de cargo de operario de tapicera a auxiliar de auditoria, pero se le informo que deba de tener la permanencia de1 ao en el puesto para poder evaluar si se le autorizaba el aumento.  - Santiago Elias Murillo Henao', '2023-10-20', '1', '2023-10-24', NULL, 82),
