(99, 'VOLUNTARIO', 'Ingreso el 25 de octubre, solo trabajo ese dia, el 26 de Octubre  informa que no vuelve por no se adapta al horario de la empresa - Santiago Elias Murillo Henao', '2023-10-26', '1', '2023-11-03', NULL, 293),
(100, 'VOLUNTARIO', 'Desea buscar otro empleo donde pueda mejorar sus ingresos puesto que tiene 2 hijos (4 y 1 ao) con mam diferente y los ingresos actuales no le estn alcanzando para cubrir los gastos.\r\nSu desempeo fue bueno. - Santiago Elias Murillo Henao', '2023-10-31', '1', '2023-11-07', NULL, 61),
(101, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Pensionado, empleado con 35 aos en la empresa, de total confianza. - Santiago Elias Murillo Henao', '2023-11-24', '1', '2023-12-05', NULL, 65),
(102, 'VOLUNTARIO', 'El empleado solo estuvo vinculado 20 das con la empresa, a los pocos das tuvo 3 dias de incapacidad, posteriormente tubo licencia de luto debido a que fallecio el abuelo. - Santiago Elias Murillo Henao', '2023-11-20', '1', '2023-12-05', NULL, 298),
(103, 'VOLUNTARIO', 'Dice que consigui un trabajo donde puede hacer horas extras y conseguir mas ingresos, fue un buen  trabajador, el 16 de Noviembre tenia citacin a descargos por ausentismo injustificado. - Santiago Elias Murillo Henao', '2023-11-15', '1', '2023-12-05', NULL, 92),
(104, 'PROBLEMAS FAMILIARES', 'Dice que el papa se pensiono y debe de acompaarlo ha hacer unas vueltas a Bogot, tubo varios llamados de atencin y ausentismos.\r\nInicio como operario, lo promovieron como lder de Pintura y de nuevo volvi como operario por que no cumplio con las espectativas como lider - Santiago Elias Murillo Henao', '2023-11-17', '1', '2023-12-05', NULL, 75),
(105, 'VOLUNTARIO', 'Se retira para irse al Choco a trabajar con la mam , se le realiz una citacin de descargos para el 8 de noviembre debido a que no asisti el 30 de Octubre por que estuvo en Bagado-Choco como testigo electoral y no inform a la empresa. - Santiago Elias Murillo Henao', '2023-11-07', '1', '2023-12-05', NULL, 91),
(106, 'TERMINACION PRACTICA APRENDIZ', 'Terminos sus prcticas antes de tiempo debido a que presentaba problemas familiares. - Santiago Elias Murillo Henao', '2023-12-14', '1', '2023-12-15', NULL, 289),
(107, 'VOLUNTARIO', 'Actu de forma irresponsable al no entregar su puesto, y renunciar sin previo aviso. - Santiago Elias Murillo Henao', '2023-12-22', '1', '2023-12-28', NULL, 297),
(108, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Persona que laboro en la empresa 32 aos, luego de ser pensionado continu trabajando con nosotros por 3 aos ms. - Santiago Elias Murillo Henao', '2023-12-28', '1', '2023-12-29', NULL, 17),
(109, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Persona que laboro por 23 aos con la empresa, su pensin salio este ao y ya decide retirarse a disfrutar de su pensin. - Santiago Elias Murillo Henao', '2023-12-29', '1', '2023-12-29', NULL, 67),
(110, 'OTRA', 'Actualmente trabaja como contratista por prestacin de servicios profesionales - Lizeth Vanessa Castilla Largo', '2023-08-13', '1', '2024-01-03', NULL, 153),
(111, 'OTRA', '', '2023-11-09', '1', '2024-01-04', NULL, 132),
(112, 'PROBLEMAS FAMILIARES', 'YA ESTABA ADAPTADO A LA EMPRESA, CUMPLIA CON LOS TIEMPOS DE PRODUCCION,  ESTABA CONTENTO EN LA EMPRESA, PERO TENIA PROBLEMAS FAMILIARES Y EL DINERO NO LE ALCANZABA . - Santiago Elias Murillo Henao', '2024-01-17', '1', '2024-01-22', NULL, 236),
(113, 'VIAJE A OTRO PAIS', 'DESEA VIAJAR A CHILE POR MAS DE 1 MES, EN CHILE SE ENCUENTRA SU MAMA Y DEBIDO A QUE EST DELICADA DE SALUD, QUIERE CONOCER A LA NIETA - Santiago Elias Murillo Henao', '2023-12-29', '1', '2024-01-22', NULL, 33),
(114, 'ESTUDIOS', 'Le sali una beca de estudio la cual pensaba que ya no se la daran por que habia esperado mucho tiempo, es una persona con mucha energa y se estaba acoplando muy bien en el proceso. - Santiago Elias Murillo Henao', '2024-01-26', '1', '2024-02-14', NULL, 310),
(115, 'TERMINACION PRACTICA APRENDIZ', 'Finalizacion de practicas, fue una persona un poco complicada de llevar, le puso quejar del SENA sobre sus actividades por que no solo eran de costura, presuntamente tuvo un accidente laboral pero no lo report en el momento oportuno y por sus propios medios se present a la ARL y esta lo rechaz debido a que no hubo un reporte a tiempo. - Santiago Elias Murillo Henao', '2024-01-18', '1', '2024-02-14', NULL, 283),
(116, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Se pensiona despus de 34 aos en la empresa - Santiago Elias Murillo Henao', '2024-01-02', '1', '2024-02-14', NULL, 23),
(117, 'VIAJE A OTRO PAIS', 'Pintor que don Salomn reclut pero decidi ir a trabajar en Chile con una prima - Santiago Elias Murillo Henao', '2024-03-01', '1', '2024-03-15', NULL, 318),
(118, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Pensionado, trabajo 21 aos con la empresa - Santiago Elias Murillo Henao', '2024-03-05', '1', '2024-03-15', NULL, 85),
(119, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Se pensiono despus de 28 aos laborando en la empresa - Santiago Elias Murillo Henao', '2023-03-15', '1', '2024-03-18', NULL, 79);
