(2, '2', '34', 'COMPLETADO', 'Andres Felipe Valencia Serna ', 'LIDER DE MAQUINADO', 'Debe ser una persona mas responsable con los horarios establecidos, ya se le han realizado observaciones respecto a esto y no lo cumple.', 'SI', 'bg-success', '2022-05-20', '2022-05-20'),
