(25, '2', '210', 'COMPLETADO', 'Andres Felipe Valencia Serna ', 'LIDER DE MAQUINADO', 'ES UNA PERSONA QUE EN EL POCO TIEMPO QUE LLEVA EN LA EMPRESA A DEMOSTRADO BUENAS ACTITUDES FRENTE A LO QUE SE LE APUESTO A HACER, SIN EMBARGO DEBE MOSTRAR MAS INTERES POR APRENDER A MENAJAR  OTRAS FUNCIONES.', 'undefined', 'bg-success', '2022-10-27', '2022-10-27'),
