(27, '2', '212', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'se esfuerza para terminar las tareas asignadas, debe mejorar un poco la calidad.', 'SI', 'bg-success', '2022-10-27', '2022-10-27'),
(28, '5', '205', 'COMPLETADO', 'Andres Felipe Valencia Serna ', 'JEFE DE PRODUCTO', 'ES UN PERSONA QUE CON EL POCO TIEMPO QUE LLEVA, A DEMOSTRADO MUCHO INTERES POR LOS PROCESOS DE MAQUINAS EN DONDE CADA DIA SE ESFUERZA POR CUMPLIR Y  AYUDAR A CADA OPERARIO A CUMPLIR SUS OBJETIVOS.', 'SI', 'bg-success', '2022-11-16', '2022-11-16'),
(29, '2', '213', 'COMPLETADO', 'Yuliana  Cifuentes Rodriguez ', 'LIDER DE LIJA Y PINTURA', 'MEJORAR CALIDAD TANTO EN EL AREA DE SUAVIZADO COMO EN LIJA ', 'SI', 'bg-success', '2022-11-29', '2022-11-29'),
(30, '2', '214', 'COMPLETADO', 'Yuliana  Cifuentes Rodriguez ', 'LIDER DE LIJA Y PINTURA', 'ES UN OPERARIO QUE DEBE PERMANECER EN CONSTANTE COMPAIA REVISANDOLE Y RETROALIMENTADOLE SUS TAREAS Y SU CALIDAD, POCA AGILIDAD, FALTA DE ATENCION, CON DIFICULTADES DE CAPTAR TAREAS COMPLEJAS.\r\nCABE RECALCAR QUE TIENE BUENA ACTITUD CUANDO SE MANDA HACER OTRAS TAREAS COMO CARGUES Y DE AUXILIAR', 'NO', 'bg-success', '2022-11-29', '2022-11-29'),
(31, '2', '207', 'COMPLETADO', 'Yuliana  Cifuentes Rodriguez ', 'LIDER DE LIJA Y PINTURA', '', 'SI', 'bg-success', '2022-11-29', '2022-11-29'),
(32, '2', '220', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Debe mejorar el trato con algunos compaeros de trabajo.', 'SI', 'bg-success', '2022-11-29', '2022-11-29'),
(33, '2', '221', 'COMPLETADO', 'Yuliana  Cifuentes Rodriguez ', 'LIDER DE LIJA Y PINTURA', '', 'SI', 'bg-success', '2022-11-29', '2022-11-29'),
(34, '2', '223', 'COMPLETADO', 'Yuliana  Cifuentes Rodriguez ', 'LIDER DE LIJA Y PINTURA', '', 'SI', 'bg-success', '2022-11-29', '2022-11-29'),
(35, '2', '224', 'EN CURSO', '', '', '', '', 'bg-warning', '2022-11-29', '2022-11-29'),
