(37, '2', '214', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'No emplea apropiadamente su tiempo, habl con el en el mes de diciembre hacindole nfasis de ser mas productivo y no parar antes del timbre. Se distrae muy fcilmente en actividades asignadas, no comprende trabajos sencillos asignados. No tiene mucha fuerza fsica para hacer tareas de cargue y descargue.', 'NO', 'bg-success', '2023-02-10', '2023-02-10'),
(38, '1', '75', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Es una persona que esta tomando un rol diferente a los puestos de trabajo que haba tenido anteriormente y obviamente necesita una formacin en el proceso, pero necesitamos que vaya tomando en cuenta las observaciones y sugerencias que se la han dado. La idea es que tome el rol de supervisor, que no se vea tan sentado en el puesto de trabajo y este mas activo en la seccin supervisando e inspeccionando producto. Reunir al grupo de trabajo y contar las metas colectivas adems de las metas no alcanzadas debe realizarse. Antes de empezar a trabajar una serie debe reunir al grupo de trabajo y mirar cual es el mejor mtodo, adems como no conoce las series en este proceso de lija y pintura tambin debe pedir informacin sobre lo que es importante en la serie o no. El proceso de canalizacin de pintura no se debe adjudicar a otra persona a no ser que sea autorizada por la jefatura de produccin previa capacitacin. Debe seguir en este proceso de formacin. ', 'SI', 'bg-success', '2023-02-14', '2023-02-14'),
(39, '1', '219', 'COMPLETADO', 'Sistemas Muebles Albura', 'AUXILIAR EN DESARROLLO WEB', 'Pruebas', 'SI', 'bg-success', '2023-02-16', '2023-02-16'),
(40, '1', '219', 'COMPLETADO', 'Sistemas Muebles Albura', 'AUXILIAR EN DESARROLLO WEB', '', 'NO', 'bg-success', '2023-02-16', '2023-02-16'),
(41, '2', '239', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'le cuesta aprender procesos incluso procesos sencillos  . se ha  ausentado dos veces en poco tiempo de pertenecer a la empresa.', 'NO', 'bg-success', '2023-03-01', '2023-03-01'),
(42, '2', '232', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Tiene un ritmo muy lento.  ', 'NO', 'bg-success', '2023-03-03', '2023-03-03'),
(43, '2', '233', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Debe mejorar la relacin laboral con sus compaeras. ', 'SI', 'bg-success', '2023-03-24', '2023-03-24'),
(44, '2', '234', 'COMPLETADO', 'Juan Manuel Galvis Velez ', 'LIDER DE LIJA Y PINTURA', 'Puede mejorar el ritmo de trabajo, es aplicado, aprende rpido, es disciplinado, ordenado y tiene muy buena disposicin para hacer cualquier tipo de labor que se le pida ', 'SI', 'bg-success', '2023-03-24', '2023-03-24'),
(45, '1', '99', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Yuliana viene haciendo un proceso de capacitacin interesante en el proceso,  se interesa por gestionar procesos y las instrucciones que se le dan tanto para ella como para su equipo de trabajo las gestiona rpidamente y las lleva a cabo. En la parte de calidad se deben reforzar procesos, metodologas para evitar reprocesos y entregas fallidas a los clientes internos, debe apoyarse en el material de trabajo como un todo en la parte de planos y especificaciones tcnicas. En la parte operativa tiene una buena interaccin con las personas a su cargo y se interesa por comunicar sus inquietudes y sugerencias, con sus pares debe mejorar la escucha activa y receptiva de los mensajes que se le transfieren. Ya a nivel de equipo debemos seguir trabajando en la capacitacin en el manejo de maquinaria y en los planes de capacitacin documentados. Las listas de chequeo deben reflejar la realidad del producto elaborado. Tiene potencial para seguir con las funciones del cargo. ', 'SI', 'bg-success', '2023-04-19', '2023-04-19'),
(46, '2', '237', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Ha avanzado en el proceso de tapizado y se esfuerza por cumplir las metas.', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(47, '2', '238', 'COMPLETADO', 'Yuliana  Cifuentes Rodriguez ', 'LIDER DE MAQUINADO', 'SE REQUIERE QUE LE PONGA MAS ANIMO DE APRENDER OTRA OPERACION, SER MAS CONCENTRADO PARA QUE CAPTE TAREAS COMPLEJAS, ESTA MUY ACOSTUBRADO AL TABAJO MONOTONO.\r\nSER MAS ORDENADO CUANDO SE PONE HACER OTRA FUNCION DIFERENTE A AUX Y CARGUE, Y PREGUNTAR CUANDO NO ENTIENDA LO QUE SE LE PONE HACER, LA MAYORIA DE LAS VECES SE QUEDA CON LA DUDA Y LO HACE COMO CREE O CON LO POCO QUE ENTENDIO.', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(48, '2', '244', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Ha mejorado la relacin con sus compaeras, esperamos que siga as. ', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(49, '3', '240', 'ACTIVA', '', '', '', '', 'bg-danger', '2023-05-10', '2023-05-10'),
(50, '2', '236', 'COMPLETADO', 'Andres  Gaviria Ortiz ', 'LIDER DE ENSAMBLE', '', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(51, '3', '242', 'EN CURSO', '', '', '', '', 'bg-warning', '2023-05-10', '2025-05-10'),
(52, '3', '243', 'COMPLETADO', 'Edith Betancourt Betancourt', 'ADMINISTRADORA', 'Tiene buena actitud en el trabajo, es colaborador y respetuoso.\r\nSe le han realizado observaciones verbales de  que no debe usar piercings en la fabrica.', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(53, '2', '261', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'No ha logrado mejorar los rendimientos, debe mejorar mucho la calidad, utiliza tiempo del horario del trabajo para otras actividades como el celular, a veces pide cambio en las actividades que esta ejecutando aun siendo trabajos no complejos como un somier.', 'NO', 'bg-success', '2023-05-31', '2023-05-31'),
(54, '1', '20', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'es un lder en formacin con aptitudes que cada vez va moldeando mas de acuerdo a los parmetros de la empresa. Se esfuerza por cumplir las tareas asignadas y los retos encomendados. Es necesario seguir liderando el grupo de trabajo hacia la inspeccin y aseguramiento de procesos ya que lastimosamente en esta parte se ha fallado un poco con devolucin de producto por clientes internos y tambin como clientes externos como Happy Sleep. Tiene muy buena disposicin y maneja de una madera adecuada los inventarios . ', 'SI', 'bg-success', '2023-06-22', '2023-06-22'),
(55, '1', '48', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Yeraldine es una chica que ya lleva en el proceso un tiempo donde se esperara que fuera mas activa, con iniciativa para acciones de mejora y empoderada del tema, pero no va mas all de lo que se le pide, el proceso con ella es muy lineal. No hace planes de verificacin e inspeccin. No cumple con los parmetros estipulados en pro de la mejora, habla mucho con personas en horarios laborales.  ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(56, '1', '75', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Juan Manuel es una persona de planta que acept el reto de liderar el proceso de lija y pintura. En trminos de manejo de materia prima e inventarios pudo sacar adelante los procesos aunque no con mucho sentido de pertenencia, hubo tems que inclusive no administraba de manera conciente. En el manejo de personal se qued muy corto y no daba ejemplo en su hacer. Muy desconectado en el proceso con los objetivos de la empresa. ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(57, '1', '99', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Yuliana es una lder que se esforz en este nuevo rol y a pesar del corto tiempo super los objetivos del proceso.  En su ltimo perodo como lder de la seccin se alej de algunos procedimientos y le falt mas comunicacin con el jefe de proceso.  Se le dificult el trabajo en equipo con sus pares sin embargo con el grupo que diriga se vi menos este efecto. ', 'SI', 'bg-success', '2023-06-22', '2023-06-22'),
(58, '5', '31', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'debe tener mas concentracin y agilidad en el proceso, debe mejorar la comunicacion y saber que informacin afecta el proceso, es insegura y por ello a veces se cometen errores. Le falta tener una visin mas global del proceso. ', 'SI', 'bg-success', '2023-06-22', '2023-06-22'),
(59, '2', '22', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'ya es tiempo que sea mas agil en el proceso, que sea autnomo y no requiera continua supervisin, debe ser mas activo no ha pasado de ayudante o funciones de cargue y descargue. No se le pueden asignar tareas diferentes e importantes proque se queda corto en la ejecucin. ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(60, '2', '52', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Willian es una persona de confianza y de buenos principios y lo hemos valorado por ello en planta, pero realmente es necesario hacer una evaluacin muy crtica de los rendimientos que quedan muy por debajo del nivel de una persona que lleva 25 aos en la empresa. No nos ayuda a ser competitivos en el proceso y sus altos tiempos hacen que los estandares de produccin se nos suba y que no podamos cumplir las metas de manera individual y que lo resultados grupales no sean los mejores. ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(61, '2', '221', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'es un chico con el que se tenia muchas expectativas desde la entrevista porque es una persona decente y respetuosa, pero su dinamismo y eficiencia no se reflejan en el proceso, se ha hecho de manera individual y con el grupo de trabajo un proceso de concientizacin acerca de mejorar los resultados, se ha tenia en la oficina de produccin hablando de rendimientos pero finalmente esto no se ve reflejado en los resultados, las programaciones con el nunca se cumplen y quedan y normalmente quedan por debajo de un 60% y obviamente esto no es ptimo para los resultados que se requieren, no podemos dar mas tiempo de capacitacin. ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(62, '2', '214', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'es una persona que hemos querido rescatar en el proceso pero si analizamos el tema de eficiencias no esta de acuerdo a los parametros exigidos para alcanzar las metas de produccin, no se le pueden asignar tareas complejas en tapizado no alcanza los tiempos de produccin. Tiene muchas ausencias por motivos diferentes los cuales afectan duramente los tiempos de produccin.', 'NO', 'bg-success', '2023-06-23', '2023-06-23'),
(63, '3', '258', 'COMPLETADO', 'Santiago Elias Murillo Henao', 'JEFE ADMINISTRADOR', 'Es una persona educada, comprometida, y responsable, sin embargo, le hace falta ms dinamismo y anlisis en sus diferentes funciones teniendo en cuenta que est en proceso de formacin universitaria.\r\nSe le ha visto mejora en la comunicacin oportuna, las actividades que se le asignan las toma de la mejor forma, siempre es muy diligente.\r\nDebe de trabajar en ser ms analtica, y tener iniciativa en su rea de trabajo.\r\n', 'SI', 'bg-success', '2023-07-04', '2023-07-04'),
(64, '3', '21', 'COMPLETADO', 'Diana Marcela Mora Cardona', 'JEFE DE DISENO Y CALIDAD', 'Tiene un buen desempeo en el proceso de diseo y desarrollo. Es una persona muy comprometida y con habilidades para el cargo de diseo.', 'SI', 'bg-success', '2023-08-04', '2023-08-04'),
(65, '4', '249', 'COMPLETADO', 'Jose Octavio  Arias Tabares', 'JEFE DE MANTENIMIENTO Y METROLOGIA', 'es muy activo en los estudios que ha realizado como la mecatrnica y electrnica para aplicarla en las actividades de la empresa', 'SI', 'bg-success', '2023-08-18', '2023-08-18'),
(66, '2', '250', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Debe mejorar la relaciones con sus compaeras de trabajo. Ha avanzado en el conocimiento con el proceso de costura', 'SI', 'bg-success', '2023-08-18', '2023-08-18'),
(67, '2', '257', 'EN CURSO', '', '', '', '', 'bg-warning', '2023-08-18', '2023-08-18'),
(68, '2', '251', 'COMPLETADO', 'Geraldine  Ganan Bueno', 'LIDER DE EMPAQUE', 'Aporta buenas ideas en las actividades diarias, realiza adecuadamente sus tareas y a tiempo.', 'SI', 'bg-success', '2023-08-18', '2023-08-18'),
(69, '3', '82', 'COMPLETADO', 'Santiago Elias Murillo Henao', 'JEFE ADMINISTRADOR', 'Es una persona que fue promovida de operario de Tapicera a Auditor, es Juicioso, responsable, educado, y con muy buena actitud.\r\nA pesar del poco tiempo a aprendido las funciones de su cargo de manera adecuada, y toma las observaciones de manera muy receptiva.\r\nDebe de ser ms activo en los inventarios, comunicar las novedades de sus funciones a su jefe inmediato, y evitar el uso de celular para temas personales.\r\n', 'SI', 'bg-success', '2023-09-13', '2023-09-13'),
(70, '1', '7', 'ACTIVA', '', '', '', '', 'bg-danger', '2023-10-20', '2023-10-20'),
(71, '2', '262', 'EN CURSO', '', '', '', '', 'bg-warning', '2023-10-27', '2023-10-27'),
(72, '2', '306', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'DIRECTOR DE PRODUCCION', 'no es dinamico,  no es una persona activa y de iniciativa, su ritmo de trabajo no es adecuado, ha estado en diferentes procesos como maquinado, ensamble y lija pero con ninguna actividad se ha conectado de la mejor manera. ', 'NO', 'bg-success', '2024-01-25', '2024-01-25'),
(73, '2', '290', 'COMPLETADO', 'German Alonso Grajales Aguirre ', 'LIDER DE TAPICERIA', 'Ninguna', 'SI', 'bg-success', '2024-01-25', '2024-01-25'),
(74, '2', '299', 'COMPLETADO', 'German Alonso Grajales Aguirre ', 'LIDER DE TAPICERIA', 'Ninguna', 'SI', 'bg-success', '2024-01-25', '2024-01-25'),
(75, '2', '327', 'COMPLETADO', 'Gustavo Adolfo Ortiz Perez', 'COORDINADOR DE PRODUCCION', 'Su ritmo de trabajo no es bueno , su actitud al momento de realizar las operaciones tampoco, muchas veces se le observa recostado en el puesto de trabajo lo cual no es una postura adecuada para un proceso productivo , adems de esto en el proceso de capacitacin de empaque no demostraba mucho inters por aprender ya que en el momento de la explicacin se concentraba en otras cosas por esta razn se reubica en otros procesos con el fin de evaluar sus habilidades y sacar su mximo potencial pero no se han obtenido los resultados esperados.', 'NO', 'bg-success', '2024-03-27', '2024-03-27'),
(76, '3', '315', 'EN CURSO', '', '', '', '', 'bg-warning', '2024-03-27', '2024-03-27'),
