INSERT INTO `observaciones` (`id`, `observacion`, `id_entrevista`, `entrevistador`) VALUES
(32, 'Denota buena actitud muy buena disponibilidad y deseo de superacin', 16, 1),
(33, 'Entrevista preliminar conducente a la vinculacin en el cargo solicitado esperando resultados de exmenes clnicos , teniendo en cuenta que supero satisfactoriamente las pruebas en fabrica.', 16, 1),
(34, 'Andrs Felipe es un muchacho que desde que inici la entrevista se ve poco agradable, con poco respeto hacia el entrevistador, su ultimo trabajo fue en Coats cadena y parece y le realizaron terminacin de contrato en lo que percibo porque su forma de ser es conflictiva, dice que la empresa no lo valor y que hay rosca en los grupos de trabajo, tambin ha sido Uber. Finalmente cuando se le habl de las actividades a a realizar dijo que no crea ser afn al proceso de lijado, que le fastidiaba la nariz con el polvo a pesar de no sufrir de rinitis.', 21, 6),
(35, 'es una persona que se mostro receptiva, ha estado en varias ocasiones en una misma empresa, este ao no ha estado vinculado a ninguna empresa- se le hablo sobre los horarios laborales- dice no tener problema si lo programan un sbado- se le hablo sobre el manejo de permisos personales y mdicos en lo posible hacerlo fuera de los horarios laborales, se le hablo sobre el uso de los elementos de proteccin personal- se le hablo sobre la rotacion en planta segn las necesidades de la empresa - con Gustavo Ortiz se le dio la vuelta a la planta pero se nota pasivo frente a los roles que debera desempear en la planta - dice que si se podira adaptar a las condiciones laborales pero realmente no se ve una persona dinmica y activa para trabajar bajos los tiempos de produccin requeridos ', 22, 6),
(39, 'pruebas sistemas', 23, 5),
(44, 'queda en estado elegible', 23, 1),
(45, 'tienes dos hermanas de 28 aos y la otra 24 aos ellas son amas de casa.. JEAN TALLA 30-CAMIBUSO S Y BOTAS 40. ESTABA CITADO A LAS 3 PERO CAYO UN AGUACERO Y POR ELLO LLEGO A LAS 3:20 MAS O MENOS. ACADEMICAMENTE ES POCO PREPARADO SOLO TIENE HASTA CUARTO DE PRIMARIA, SE NOTA NECESITADO LABORALMENTE , SE NOTA INTERESADO POR EL TRABAJO , TIENE DISPONIBILIDAD PARA TRABAJAR LOS SABADOS SI SE REQUIERE, SE LE HABLA DE LA NO UTILIZACION DE CELULAR EN PLANTA Y SOBRE EL USO ADECUADO DE ELEMENTOS DE PROTECCION PERSONAL ...SE LE EXPUSO EL PROCESO DE LIJADO Y MAQUINADO MANIFESTANDO QUE LE GUSTABA ESAS ACTIVIDADES, SE NOTA CON UN PERFIL ACTIVO ', 24, 6),
(46, 'Entrevista preliminar aprobada por la Ing jefe de Produccin Sra. Viviana Romero', 24, 1),
(47, 'SE LE HABLO DE LOS HORARIOS LABORALES Y LA POSIBILIDAD DE SER CITADO EN ALGUNA OCASION LOS SABADOS A LABORAR SIN TENER PROBLEMA POR ELLO, SE LE HABLO DE LAS SECCIONES  Y ROTACION DE PERSONAL EN LAS AREAS DE INTERES DE LA EMPRESA SEGUN SUS NECESIDADES ASI MISMO HIZO EL RECONOCIMIENTO FISICO DEL ENTORNO, SECCIONES Y ACTIVIDADES QUE LE TOCARIA HACER, SE LE HABLO DEL USO DE EPP Y EL NO USO DE TELEFONO CELULAR, ENTRE SUS OCUPACIONES DICE VENDER PRODUCTOS/ROPA POR INTERNET A DOMICILIO DICE QUE YA LAS VENTAS NO ESTAN TAN BUENAS POR LA TEMPORADA, TAMBIEN DICE QUE ADMINISTRO UNA BARBERIA DE MANERA INFORMAL CASI UN AO PERO QUE EL NEGOCIO CERRO Y TAMBIEN POLICHO EN UN TALLER LLAMADO AUTORETOQUES MAX, TAMBIEN LE TOCA ARMAR Y DESARMAR ALGUNAS PIEZAS DE LOS AUTOMOVILES DICE QUE SOLO LO CONTRATARON PORQUE HABIA MUCHO TRABAJO POR TEMPORADA TRABAJO 6 MESES. SU PAPA ES PINTOR AUTOMOTRIZ, TIENE 39 AOS PERO NO VIVE CON EL  Y SU MAMA FALLECIO HACE 7 AOS', 26, 6),
(48, 'CANDIDATO QUE POR SU PERFIL DE DEPORTISTA PROFESIONAL RUGBY, PRETENDA ESTAR UNOS MESES AC EN LA EMPRESA PARA REUNIR UNOS  DINEROS Y LUEGO  VOLVER A VIAJAR FUERA DEL PAS. INCLUSO POSTERIOR A LA ENTREVISTA VIRTUAL LLAM PARA DESISTIR DEL PROCESO, CONSIDERANDO QUE ERA MEJOR BRINDARLE LA OPCIN DEL CARGO QUE VERDADERAMENTE LO NECESITARA.', 25, 1),
(49, 'TELEFNICA Y PREVIAMENTE SE HIZO LA ENTREVISTA VIRTUAL, PARA LO CUAL DENOT MUCHO INTERS, GRAN DISPONIBILIDAD Y BUENA ACTITUD, POR LO QUE SE CONSIDER QUE ERA UN CANDIDATO ELEGIBLE Y VIABLE PARA EL PROCESO QUE SE REQUIERE EN FBRICA.', 26, 1),
(50, 'CANDIDATA CON BUENA ACTITUD Y DISPONIBILIDAD PARA LA VACANTE, NO TIENE PROBLEMAS CON LOS HORARIOS Y SE LE CORRESPONDE ALGN FERIADO LABORAR, NO LE VE INCONVENIENTE. TIENE BUENA FLUIDEZ VERBAL  E INTERS POR EL CARGO, LO VE COMO UN RETO ALCANZABLE. APARTE QUE LA GERENTE REGIONAL SRA. MARIA DEL PILAR ORREGO CONCEPTU LO SIGUIENTE: \"Denota inters por trabajar en la organizacin, sabe gestionar bases de datos, ha trabajado por cumplimiento de presupuestos, es dinmica es su conversacin, est enfocada en ubicarse en una organizacin estable, sin embargo, no demuestra estabilidad laboral, su experiencia en call center es limitada y no trabaja bajo presin. Es una candidata que se puede formar en el proceso\".', 27, 1),
(55, 'VALORES: Disciplina, responsabilidad, tiene claridad en la vocacin y sensibilidad comercial. Est  bien enfocado en las ventas.\nFORTALEZAS: GRACIA DE DIOS,  COMPROMISO Y DISCIPLINA,\nAspectos a Mejorar: Crecimiento profesional y sostenibilidad en las ventas.\nCandidato Elegible (S)-  Entrevist SHC- SANDRA GONZLEZ\nCalificacin Cualitativa: 9/10\nConcepto final entrevistador: Denota muy buena fluidez verbal, afn con las ventas, lenguaje muy apropiado, conectado con sus metas y objetivos, gran disposicin e inters y muy buena actitud.\nSe coincide con los conceptos favorables de la entrevistadora Sra. SANDRA GONZLEZ\n', 28, 1),
(56, 'SANDRA GONZALEZ, GTE REGIONAL DE VENTAS APROB CANDIDATO SIN NINGUNA OBJECIN.', 28, 1),
(57, 'SE PRESENTA UNA OPORTUNIDAD DE UBICAR ESTA PERSONA EN UNA ACTIVIDAD DE CARGUE Y DESCARGUE RELACIONADA CON EL PROYECTO PROVENZA. PARA ESTA FUNCION GEOVANNI TIENE TODAS LAS CUALIDADES FISICAS PARA DESEMPEAR LA LABOR Y EL TIEMPO DISPONIBLE PARA ELLO ES EL REQUERIDO POR LA EMPRESA. TIENE BUENA APTITUD, RESPETUOSO Y DINAMICO ', 25, 6),
(58, 'para el perfil requerido de cargues y descargues en Provenza tiene el perfil adecuado, si desarrolla un buen proceso en Provenza se podra pensar en promoverse a fabrica ', 29, 6),
(59, 'le quedo claro la duracion de la actividad con provenza, dice gustarle la actividad y la ha desarrollado en procesos de cargues y descargues ', 30, 6),
(60, 'un perfil adecuado para la parte de cargues y descargues, su enfoque actual es mas hacia la musica y los tatuajes pero para el lapso de tiempo que requerimos la actividad es adecuado... se le hizo la observacion en que debe sujetarse el cabello y no usar accesorios ', 31, 6),
(61, 'Es un empleado referido en el voz a voz por uno de los candidatos que se postularon para este cargo especfico de cargue y descargue, Se Michael Andrs Cortez.', 31, 1),
(62, 'De conformidad con la actividad temporal especfica que le corresponde hacer cargue y descargue en Provenza , podra ser una opcin en fbrica ms adelante por la formacin tcnica del Sena.', 30, 1),
(63, 'Es un aspirante referido por el vigilante de parqueaderos Hctor F Seplveda, qu bien pudiera realizar la labor de cargue y descargue temporal, aunque en su sentir est en ahorrar dinero con la ilusin de emigrar del pas por una mejor calidad de vida.', 29, 1),
(64, 'TOLERANTE- REFLEXIVA -ANALITICA. DATOS ADIICONALES PESO 58 KG 1.60 M TALLA M BLUSA PANTALN 8 CALZADO 36. TIENE NCLEO DE AMIGOS MUY SELECCIONADO. BUENA ACTITUD Y DISPONIBILIDAD.', 32, 1),
(65, 'la contadora Paula Andrea Jimnez, evalu las pruebas tcnicas y conceptu muy bien sobre su perfil y buena actitud, candidata elegible  e idnea para el cargo de auxiliar contable oficina prncipal.', 32, 1),
(66, 'Es una persona muy respetuosa y trabajadora. Prest demasiada atencin a la entrevista y demuestra ganas de superacin personal y laboral increbles. No se  muy gil y se nota muy pasivo  frente a las expectativas que tendriamos para el cumplimiento de objetivos en la planta de produccion ', 33, 6),
(67, 'se mostr muy interesado en la entrevista, se le expuso todas las necesidades de la empresa, la disciplina, constancia y dinamismo que requerimos en el proceso. Dice estar a la altura de las necesidades, horarios y expectativas de la empresa. Se la hablo del cumplimiento de objetivos, la no utilizacion de celulares en planta, uso de EPP y la obligatoriedad de no uso de piercing y accesorios.\n(si a consumido sustancias hace dos meses.)\n', 34, 6),
(68, 'apto  para el cargo', 35, 5),
(69, 'aplica para el puesto', 35, 1),
(70, 'dijo que le gustaba mucho el horario sin trabajar los sbados sin embargo le hice la observacin que quizs algn sbado si toque hacer alguna programacin con horario extra, se le hablo sobre la importancia de cumplir horarios de trabajo y objetivos de planes de trabajo, que es muy importante la escucha de instrucciones. Se le hablo sobre el no uso de celulares y sobre el uso obligatorio de EPP. Se evala como una persona dinmica, activa con buena escucha. ', 36, 6),
(71, 'Candidato elegible que se adapta a las condiciones laborales ofrecidas, no tiene dificultad con los horarios. le gustara el cargo de lijador-suavizador y ofrece todo el compromiso, disponibilidad, puntualidad y responsabilidad para asumir las funciones que le impartan. Necesita el trabajo,  quiere salir adelante y ayudarle a su mam en darle una mejor calidad de vida. Est enfocado  en ubicarse y tener una pronta estabilidad laboral. Denot buena actitud, ganas y volunta.', 36, 1),
(72, 'es una persona que se ve que necesita el trabajo, sin embargo su presentacin personal no es la mas adecuada adems que en la entrevista habl de ciertos inconvenientes disciplinarios mientras pag servicio militar, le toc estar recluido cierto tiempo para obtener su boleta de libertad. Estudia los sbados por ello le gusta el horario sin embargo se le dejo claro que quizs algn sbado se deba acudir a realizar algunas labores segn las necesidades del trabajo. Si consume algunas sustancias ', 37, 6),
(73, 'los padres viven en el Choco, la mam se llama Marta de 47 aos y se dedica a la minera y el papa se llama Jos Urbano con 50 aos, tambin se dedica a la minera. Son 6 hermanos 4 mujeres y 2 hombres y todos viven en la misma casa en Samaria. Andrs Felipe no tiene moto.  Se le hablo sobre la rotacin de las personas en la planta, sobre el uso adecuado de EPP,. el no uso de celulares en planta, la parte de rendimientos y disciplina requerida en el proceso. dice que de las secciones vacantes le gusta lija. se le da la vuelta de la planta para reconocimiento de procesos, Gustavo Ortiz lo ve interesado en el proceso y lo describe como un muchacho serio. ', 38, 6),
(74, 'Es un candidato referido por el Dr Jhonier Asprilla,  tiene referencia de la Fabrica, es un joven de buen biotipo y condiciones fsicas, se adapta a la jornada laboral y salario ofrecidos, le gustara seguir estudiando y capacitando,  valora la responsabilidad, el trabajo en equipo, el compromiso , la puntualidad y responsabilidad. Tiene necesidad de ubicarse en una empresa que le d un buen respaldo laboral y de seguridad social. Es una opcin viable y elegible para el cargo de operario en fbrica.', 38, 1),
(75, 'se ve una persona con mucha personalidad, muy ameno para hablar , con una muy buena presentacin personal, dispuesto a laborar en lo que se le asigne, dice que quiere aprender de todo que no le gusta que le digan que hacer ya que mantiene siempre disponibilidad, le gusta trabajar horario extra, esta de acuerdo con el salario, los horarios y el cumplimiento de planes de trabajo . Gustavo ortiz lo orienta en planta. No tiene problemas tampoco con hacer procesos de cargue y descargue en Provenza. Dice que tiene curso en alturas aunque venci en hace 20 dias.', 39, 6),
(76, 'hay que analizar este perfil detenidamente desde la parte salarial, el dice haber renunciado a su ultimo empleo por este factor, renuncio el 16/05/2022, dice que su salario era prestacional, cosa que no lo creemos , dice tener toda la aptitud para hacer una prueba de pintura, en su parte de aspiracion salarial no hablo de un valor el dice que el sueldo que tengamos asignado para pintor y mirar mas adelante segun sus resultados como se puede mejorar. Se le hablo de los horarios laborales, se le hablo del cumplimiento de tareas. se le cita para prueba de pintura el 20/05/2022 a las 9 am (ojo esta entrevista inicial se desarrollo el 19/05/2022 pero no guardo en plataforma y toco volverla a diligenciar). ', 40, 6),
(77, 'Candidato referido por Hctor Fabio Seplveda, candidato que denota mucho inters y gran actitud, es una persona espontnea y coloquial, aduce no tener dineros para realizar la compra del enemad travad rectal pero lo conseguir prestado, estuvo Incapacitado seis das recientemente por una sintomatologa parecida al Covid, fiebre, desaliento y malestar corporal, est vacunado con primera dosis de Sinovac. Informa tambin que consumi un\" pase de perico\" en el mes de enero de 2022, dice no haber consumido desde esa fecha, lo atribuy a problemas familiares y depresin, segn l es un tema superado. Candidato Elegible y depender de los filtros de vinculacin.', 39, 1),
(78, 'Candidato referido por Hctor Fabio Seplveda, trabaj en el extranjero, regres al pas, hace unos aos atrs, es un pintor segn indicaciones que es calificado y conocedor del oficio, no obstante genera inquietud por sus ingresos que han sido superiores al Smmlv, su ltimo empleo, renunci al cargo por ese factor salarial y tiende a ser comparativo y diferencial con personas que desempean oficios menos calificados. Es una opcin elegible, pero depender qu salario se le ofrece por encima del Smmlv.', 40, 1),
(79, 'REFERIDA POR SANDRA GONZLEZ -GTE REG DE VENTAS NORTE Y SHIRLEY CHAVARRO-VENDEDORA M ALBURA NEIVA. BIEN RECOMENDADA Y CON  CLARIDAD EN LOS MPRESUPUESTOS Y RESPONSABILIDADES DE SACAR ADELANTE LA TIENDA A CARGO.', 42, 3),
(80, 'ENTREVISTA REALIZADA VIDEO-GOOGLE MEET. DENOTA BUENA ACTITUD, BUENA FLUIDEZ VEBAL, CON UNA CLARIDAD DE LAS METAS Y VENTAS. HIZO HINCAPIE EL TRABAJO EN EQUIPO Y SOLIDARIDAD CON LA COMPAERA. SE ADAPTA A LAS CONDICIONES LABORALES Y JORNADAS FLEXIBLES DE HORARIOS EN CENTROS COMERCIALES. ES UNA CANDIDATA ELEGIBLE, IDNEA Y CON EXPERIENCIA EN ESTE NUEVO FORMATO. SU CONTRATACIN EMPIEZA A REGIR A PARTIR DEL  MARTES 17 DE MAYO DE 2022.', 42, 1),
(81, 'es una joven con muchas expectativas hacia el aprendizaje practico, se le nota buena energa, con un buen dinamismo, dice no tener problema con el polvo de planta y lo que conlleva pertenecer al rea de mantenimiento. Ve clases de 6 a 10 pm pero no tiene inconveniente con los horarios laborales expuestos para la prctica. ', 41, 6),
(82, 'Se le hizo la prueba en la cabina de pintura donde fue muy bien, pinto una cubierta oikos 6 pts y utiizo una tecnica adecuada y  un buen manejo de los equipos ( fluido de aire, regulacion), distancia y forma de aplicacion adecuada. ', 40, 1),
(83, 'EL SR. ALEJANDRO AGUILAR LE ENTREVIST EL DA 16 DE MAYO DE 2022, LE PARECI UN BUEN CANDIDATO, REUNE EL BIOTIPO Y LA ACTITUD PARA DESEMPEAR EL CARGO, TIENE BUENA FLUIDEZ VERBAL Y PREV QUE SE PUEDE ACOMODAR RPIDAMENTE AL ROL DEL TRABAJO Y LAS FUNCIONES ASIGNADAS EN BODEGA, PLANTA, ENTREGAS Y OFICIOS VARIOS. LE DIO EL VISTO BUENO PARA SU INGRESO.', 43, 1),
(84, 'EN LA ENTREVISTA DENOT MUY BUENA ACTITUD Y MUCHAS GANAS DE EMPEZAR LA LABOR, SE MOSTR A GUSTO Y SATISFECHO CON LAS CONDICIONES LABORALES OFRECIDAS, HORARIOS Y DE BUEN RECIBO CON LOS INGRESOS , ADEMS LE GUST MUCHO EL INCENTIVO CON LAS ENTREGAS DE PRODUCTO QUE SE VAN A INSTALAR. DESEA INICIAR LO MS PRONTO POSIBLE. SU VINCULACIN FUE APROBADA PARA EL VI 20 DE MAYO DE 2022. ', 43, 1),
(85, 'LA ENTREVISTA FUE REALIZADA POR LA ING VIVIANA ROMERO (JEFE DE PRODUCCIN) Y  EL SR. OCTAVIO ARIAS(JEFE DE MANTENIMIENTO). lA ENTREVISTA CAUS UN BUEN ASPECTO FAVORABLE Y DE ACEPTACIN EN LOS ENTREVISTADORES, POR LO QUE CONJUNTAMENTE CONSIDERAN QUE ES LA OPCIN ELEGIBLE PARA ACOMPAAR A DON OCTAVIO E EL PROCESO DE APRENDIZAJE Y DESARROLLO EN EL REA DE MANTENIMIENTO DE LA FBRICA, POR LO TANTO, SE APRUEBA SU VINCULACIN COMO APRENDIZ UNIVERSITARIO DE LA UTP EN ETAPA DE PRCTICA Y DEPENDIENDO DE SU DESEMPEO, SE ADOPTAR MS ADELANTE SU VINCULACIN NOMINAL COMO ASISTENTE DE MANTENIMIENTO.', 41, 1),
(86, 'Tambin se le entrevist telefnicamente , precisando el tema de sus ingresos, pues en sus anteriores trabajos haba ganado por encima del milln  doscientos mil y se le insisti el porqu se haba retirado de la ltima empresa, manifestando que se senta inferior en su salario a empleados que hacan un menor oficio y que no tenan la calificacin de pintor, y les pagaban cerca a lo que l se ganaba, por eso tom la decisin de renunciar voluntariamente. Atendi y acogi la  propuesta salarial de $1.150.000= con la empresa Muebles Alburas SAS, esperando que en tres (3) meses despus de mostrar un buen desempeo y compromiso, por lo menos reconsideren sus ingresos y quiere hacer carrera dentro dela empresa aspirando a ser un lder de proceso. Por consiguiente, se aprueba su ingreso y depender de los exmenes  mdicos clnicos que podamos contar con l a partir del jueves 26 de mayo de 2022.', 40, 1),
(87, 'le inquieta mucho la parte salarial ya que opina que por su experiencia en la aplicacin de pintura debe ganarse mas del mnimo, tambin le preocupa que le digan que en un determinado tiempo se le diga que despus segn su rendimiento se le mejorara salarialmente ya que con otras empresas ha pasado lo mismo, sin embargo se le dijo que todo eso iba de acuerdo a la calidad de los procesos y a los resultados obtenidos. Tiene motivacin hacia el trabajo y tiene una buena personalidad, tiene aptitud de liderazgo. Vive con su ta porque su madre falleci hace aos y quedo al cuidado de sus abuelos paternos quienes tambin ya fallecieron. Su papa vive en Chinchin y es agricultor. Es hijo nico. Se le hizo una prueba de aplicacin  de pintura , cubierta mesa comedor oikos 6 pts. color negro con Poliuretano. En la prueba se evidencia que tiene buen conocimiento tcnico en el acondicionamiento y regulacin de equipo pintura ( pistola, tacho y pieza a pintar). La unidad le qued chorreada pero de una vez hizo nfasis en la falla, la cual era el posicionamiento de la cubierta de manera vertical que limitaba los movimientos y la continuidad de la pintura en la superficie ( aspectos que internamente se han evaluado y han resultado ciertos) . ', 44, 6),
(88, 'ASPIRANTE QUE POR SU EXPERIENCIA EN EL SECTOR DE  MANUFACTURA DE MUEBLES, LE PUEDE APORTAR MUCHO  A LA EMPRESA. A PESARDE QUE TIENE ASPIRACIONES DE MEJORAR SUS INGRESOS, SE LE MANIFEST QIE POR SU BUEN DESEMPO, CALIDAD EN EL TRABAJO Y COMPROMISO, PODR ASPIRAR A MEJORES SUS INGRESOS, DENOTA LIDERAZGO, BUENA FLUIDEZ  VERBAL Y SUPERACIN. ES UNA OPCIN ELEGIBLE. SUPER LA PRUEBA  TCNICA DE PINTURA. SE ADAPATA A LAS CONDICIONES LABORALES OFRECIDAS Y JORNADAS FLEXIBLES DE HORARIOS Y ESPERA QUE SEA TENIDO EN CUENTA PARA LA MEJORA DE SUS SALARIOS Y PORQU NO OCUPAR O CONVERTIRSE EN UN LDER DE PROCESO.', 44, 1),
(89, 'es un muchacho joven sin mucha experiencia laboral, a pesar que sus condiciones de vida en el Choco demuestran que puede tener necesidades econmicas el muchacho  no se muestra muy dinmico y parece muy inmaduro laboralmente. Esta entrevista se realiz realmente el 24/05/2022 pero se borr de la aplicacin Nexus quedando la informacin del registro un poco mas limitada. Didier es muy joven y se nota con una actitud muy relajada y poco comprometida. En la visita a la planta tampoco se tuvo una buena retroalimentacin ya que no notamos buena percepcin con los procesos de cargues y descargues de hornos.\n', 45, 6),
