(160, 'ESTE AO NO HA TRABAJADO CON EMPRESQA DIRECTAMENTE SINO QUE TRABAJANDO COMO INDEPENDIENTE.  se le dijo que si llega a trabajar con nosotros no puede hacer trabajos externos. Se le habla de los horarios laborales, el uso adecuado de EPP, valores corporativos, se le habla sobre los tiempos para citas medicas y permisos personales, programaciones de produccin. Dice no tener inconveniente se ve afin con procesos de lijado, pintura y tapiceria.', 83, 1),
(161, 'es un muchacho que se ve con unos valores muy especiales, atento, responsable, disciplinado, correcto. A pesar de su corta edad demuestra ser muy responsable de hecho dice que trabaja desde los 16 aos y le debe ayudar a su mama con cosas de la casa como hacer oficio y con el cuidado de los hermanos y les ayuda hacer tareas.  Se le hablo de la reubicacin de personas para nivelar flujos de trabajo, se le hablo de los horarios para citas medicas y permisos personas, los tiempos de alimentacin. Tiene una energa muy positiva p ara el proceso y fcilmente puede adaptarse a necesidades de lija, tapicera o maquinado. ', 84, 6),
(162, 'es una persona que se hbil en los procesos sin embargo se nota una persona inestable, trabaj en Crisaltex pero referenci que renunci porque lo requisaban en la entrada y salida y se sinti violentado en su derecho porque el no es ningn delincuente y dice que ha ledo mucho sobre los derechos de los trabajadores y el cdigo sustantivo de trabajo. Me da la sensacin que es una persona que no le gusta el tema de reglamentos o normas internas de la empresa y se nota conflictivo.  Se la habla sobre el cumplimiento de planes de trabajo, uso de EPP,  horarios de ingreso y salida, horarios habilitados para citas mdicas y permisos personales. ', 85, 6),
(163, 'Candidato que pas la entrevista presencial, denot buena actitud y ganas para empezar proceso, se autoriza inicio trmites de documentos y valoracin de EM clnicos. Elegible. Recomendado por operario de fbrica Santiago  Rentera (primo).', 84, 1),
(164, 'Candiadato que denot seriedad, vocacin de compromiso y necesidad de encontrar una empresa que le brinde estabilidad laboral. Pas filtro de entrevista presencial. Elegible. Inicia trmites de EM clnicos y documentos. ', 83, 1),
(166, 'llego un poco tarde a la entrevista 9.09 am pero argumento estar cerrada la va por el paso de el clsico RCN. Se nota un muchahcho muy interesado en el proceso tiene solo 22 a{os pero ya tiene dos hijas, argumenta trabajar desde los 14 aos. No se nota muy estable en sus trabajos pero dice que es porque no le ofrecan toda la parte de prestaciones sociales. Usa expansiones pero se le hizo claridad que no puede usarla en planta. Se le hizo nfasis en los horarios laborales, el procedimiento de permisos personales y mdicos.  Ha trabajado en empresas textiles pero tienen afinidad con los procesos. Puede participar de procesos de ensamble o tapicera.  ', 86, 6),
(167, 'Candidato que super el primer flitro de la entrevista presencial, en la virtual denot ganas, espontaneidad y deseos de vincularse a una empresa que le d estabilidad laboral y que pueda ascender, desea terminar su ciclo acadmico y hacer alguna carrera tcnica, quiere sacar  sus hijas adelante. Denot buena actitud y disposicin. ELEGIBLE y se dispondr a realizar los trmites de vinculacin y exmenes  mdicos clnicos.', 86, 1),
(168, 'se ve muy entusiasmado en el proceso, se ve una persona muy responsable. Tiene ideales muy claros tiene una gran motivacin sus hijos y su esposa.  Se le habl sobre el trmite con los permisos personales y mdicos, el uso de EPP, horarios de alimentacin, se le habl sobre el salario. Se le hablo sobre la regulacin y nivelacin de flujos de trabajo.  ', 87, 6),
(169, 'Candidato  que cumple perfil de acuerdo a las caractersticas presentadas , en la entrevista presencial denot buena actitud y deseos de vincularse con una empresa que le brinde seguridad y estabilidad laboral. ELEGIBLE y  se proceder con los trmites de documentos y Exmenes mdicos clnicos pertinentes.', 87, 1),
(170, 'habl de sus padres que viven hace mas de 15 aos en el Libano/Tolima, su papa es agricultor y ya tiene mas de 70 aos y su mama es ama de casa.  Se le hizo la prueba en costura y tiene experiencia principalmente en el manejo de mquina filete adora en el manejo de maquina plana debe capacitarse mas, aunque si se ubica en la seccin de empaque puede en momentos propicios potencializar el manejo de maquina plana y mquina doble aguja. se le habl sobre los horarios laborales, uso de EPP, tareas diarias y el procedimiento para permisos personales y permisos mdicos. ', 88, 6),
(172, 'Candidato No se present a exmenes mdicos clnicos programados. Desisti del proceso. NO ELEGIBLE', 79, 1),
(173, 'candidata que tiene su pricipal fortaleza en el manejo de la Mq. fileteadora y tambin en menor grado en la Maq. plana. Denot buen actitud y ganas de vincularse en la entrevista  preesencial. Se adapta alos horarios y condiicone slaborales ofrecidas. Tiene vocacin de superacin y crecimiento profesional. ELEGIBLE.  Empezar los trmites de vincualcin y EM clnicos.    ', 88, 1),
(174, 'es un muchacho muy joven pero se nota con una aptitud irresponsable quizs dada por su misma edad aunque argumenta trabajar desde muy chico en el campo. Se nota una persona irresponsable con respuestas demasiado irreverentes en la entrevista. Me llam mucho la atencin acerca de algunas respuestas donde deca que le gustara ubicarse en la seccin de tapicera porque es mas suave y que no le gusto nada de su actual trabajo porque era su duro. Lo descarto para seguir en el proceso porque necesitamos conectar a nuestro grupo de trabajo personas muy comprometidas, estables y toderas, cualidades que no pude captar plenamente en Yilmer.', 89, 6),
(175, 'Dice que esta laborando actualmente pero que la planta la van a trasladar para Dosquebradas entonces le quedara mas difcil el transporte y mas con lo que devenga en este momento. En Muebles Santa se estn demorando hasta 4 o 5 das para pagar la quincena pero dice que su aspiracin salarial es poderse ganar quincenalmente al menos $ 700.000 pesos.  Se le hizo la prueba de pintura con dos mesas centro Damara y el muchacho pudo regular el equipo de pintura.  Las mesas se le chorrearon un pco pero conoce la tcnica de aplicacin y manejo del proceso. Expuso estar un poco nervioso en la prueba. ', 90, 6);
INSERT INTO `observaciones` (`id`, `observacion`, `id_entrevista`, `entrevistador`) VALUES
(176, 'Candidato que actualmente est laborando en Muebles Santa durante 5 aos, aspira a un mejor salario ,si llega a tomar la decisin de retirarse , denot ganas, entusiasmo, adaptabilidad a los horarios y pretende una mejor propuesta laboral para venirse a laborar con Albura, depender que los exmenes mdicos clnicos, se le realicen en horas de la tarde 4:45  p.m - 6:00 p.m  y quizs los sbados muy temprano 6:30 -8:00 a.m porque su horario laboral donde actualmente trabaja  es de 7-5  por ello le impide presentarse antes . Candidato Elegible , est rodeado de un buen ncleo familiar , se le llamar para convocarlos a proceso de trmites  de vinculacin con una oferta salarial.', 90, 1),
(177, 'la mama es ama de casa y vive en Caicedonia- Tiene dos hermano y una hermana los hermanos viven Cali y son independientes la hermana vive en la Tebaida y es ama de casa- la hija vive en Caicedonia- ha vivido casi todo el tiempo en Caicedonia decidi venirse para Pereira ya que en Caicedonia hay pocas fuentes de empleo. \nES AMIGO DE STEYCI DE HACE AOS, TIENE ASPIRACIN SALARIAL EL ASIGNADO, BUSCA LO QUE LE\nRESULTE. no tiene mucha estabilidad laboral ya que ha hecho trabajos informales, dice que se acopla fcilmente al trabajo que le asignen. Se le habl que los permisos se deben realizar los das sbados y se le habl sobre el cumplimiento de objetivos de trabajo en planta. Se le hizo nfasis en el uso de los EPP, de los horarios de ingreso y salida y la reubicacin de personal en planta para la regulacin o nivelacin de los flujos de trabajo.', 91, 6),
(178, 'Candidato referido x Steicy Londoo ex empleada. Present buena actitud y  disposicin en la entrevista presencial . Empezar trmites de vinculacin y realizacin de exmenes mdicos clinicos, su vinculacin se prev dentro de los tres das ss.', 91, 1),
(179, 'tiene un buen perfil y se ve que se puede acoplar fcil al proceso. Se le dio toda la informacin de horarios laborales, rendimientos , uso adecuado EPP, dotaciones, seguimiento de procesos. Se puede asignar al proceso de lijado y suavizado.\n', 93, 6),
(180, 'el perfil no me pareci que se acopla a las necesidades de la empresa. Sustenta que lo que no le gust de la otra empresa era la exigencia de los procesos. En el proceso de entrevista los gestos, respuestas y postura no me dieron indicios de ser un buen candidato para el puesto. Se ve muy inestable en el proceso', 92, 6),
(181, 'Aspirante  muy callado, pero en la medida que se le va dando confianza por parte del entrevistador, va respondiendo, denota sinceridad, seriedad y buena actitud. Pas el  filtro de la entrevista virtual y presencial y se dispondr a iniciar los trmites de vinculacin de exmenes mdicos clnicos y dems aspectos. candidato Elegible.', 93, 1),
(182, 'se le hizo una prueba en la parte de costura con un embono y trabaja de manera adecuada, se le hace observacin sobre uso de EPP, toma y medicin de rendimientos, tramitologa con permisos personales. Se le hizo la observacin que si empieza a trabajar con nosotros no puede seguir recibiendo trabajo para costurearle a don Libardo. ', 94, 6),
(183, 'es un muchacho que presenta dificultades para desenvolverse bien en una conversacin, no lo apruebo para seguir en el proceso ya que pienso que debe tener unas condiciones fsicas diferentes : peso, estatura y agilidad .\n', 95, 6),
(184, 'Candidata referida por el Ing Luis Guillermo Espejo ( Ex trabajador), ella  denota buena actitud , ganas  de empezar a laborar en una empresa que le d estabilidad laboral. Ha tenido periodos intermitentes en los trabajos, el ltimo trabajo fue contratista por obra y destajo. Tiene 914 semanas , 51 aos, y pertenece al RAIS. Presenta inconvenientes en la audicin de ambos odos desde su ninez. Elegible, iniciar trmites de vinculacin.', 94, 1),
(185, 'el seor se ve una persona responsable y correcta. Esta dispuesto a aprender de otras areas y como dice terminar de especializarse en el tema  en otros procesos diferentes a la talla en lo que si es fuerte. El seor Tonny expone que no es experto o afn a manejo de maquinaria, herramienta manual si. El segn su experiencia y habilidades puede ubicarse en la seccion de ensamble o lijado. Tambin expone que le ha tocado pintar aunque no es alli muy experto. Se le especifica todo el proceso, uso de elementos de EPP, reubicaciones de personal en planta, el no uso de celulares en momentos laborales, seguimiento de cumplimiento de actividades, compromiso con el SGC, horarios laborales, salario entre otros. ', 96, 6),
(186, 'Candidato de origen venezolano que est gestionando trmite de aprobacin PPT, obstculo inicial para empezar  trmites de afiliaciones en el Sistema de Seguridad Social Integral. Su proceso se reiniciar una vez tenga el documento en firme.', 96, 1),
(187, 'es una persona con un perfil interesante sin embargo el quiere una practica muy operativa o en campo y gran % del sentido de la practica es documental , digitacion y desarrollo de manuales.\nMe gustaria inicialmente verificar otros perfiles ', 97, 6),
(188, 'es una persona con un perfil interesante sin embargo el quiere una practica muy operativa o en campo y gran % del sentido de la practica es documental , digitacion y desarrollo de manuales.\nMe gustara inicialmente verificar otros perfiles ', 97, 6),
(189, 'De acuerdo al concepto emitido por la entrevistadora la Ing. Produccin se contempla como una opcin viable , no obstante, con la posibilidad de entrevistar ms opciones.', 97, 1),
(190, 'en Colombia no ha trabajado con buenas condiciones laborales sus jefes han abusado de el en cuento a pago de horarios extras o  prestaciones sociales, quiere estar vinculado a una empresa donde tenga todo el cubrimiento de salud para sus hijas. Tiene buena experiencia en el mbito de la carpintera. Por su experiencia se puede ubicar en el rea de maquinado. Se le habl de las condiciones de trabajo, las jornadas laborales, el uso de EPP, no uso de telfonos celulares, la asignacin de lockers, horarios de alimentacin, nivelacin en planta que a veces da pie a reubicacin de personal en reas de trabajo diferentes.\nDice estar de acuerdo con las condiciones de trabajo expuestas.', 98, 6),
(191, 'Aspirante que fue localizado en un taller de muebles y pintura en  Santa Rosa, estuvo muy interesado en que lo entrevistaran, desde el momento en que se enter de la vacante. Denot seriedad, buena actitud y disposicin, lo que ms mostr, ganas y mucho inters. Candidato Elegible que depender del resultado de los exmenes mdicos clnicos para continuar proceso.', 98, 1),
(192, 'Juan Daniel es un muchacho que se ve que es de buenos valores, pero se ve demasiado pausado y poco dinmico, de hecho en la conversacin natural que se tuvo en la entrevista se ve que procesa pausada la informacin y a veces sus respuestas no son tan coherentes de acuerdo a lo que se le ha preguntado. Sus padres y hermana vive en Apia y el vive ac solo. Por ahora no lo veo tan factible para el proceso de produccin donde se revisan rendimientos y se requieren parmetros de cumplimiento en cuanto a cantidad y calidad.', 99, 6),
(193, 'dice no vivir con su mama y con el hermano no tiene mucha cercana. Su plan es mudarse para Cartago dice que el acceso se le hace fcil ya que tiene moto y le pregunt acerca de los gastos y dice que ya lo tiene contemplado. Le pregunt acerca de buscar empleo en Cartago y dice que all solo hay una fuente de empleo grande y es la ladrillera. Tiene buena disposicin fsica, se le hablo de las condiciones laborales, necesidad de cumplir planes de trabajo y programaciones, reubicacin de personal en planta  para nivelacin de flujos de trabajo. Se le inform del uso de EPP, no uso de celulares y accesorios.  ', 100, 6),
(194, 'Candidato que denot inters en la charla telefnica y la entrevista presencial. Se adapta a las jornadas y condiciones laborales ofrecidas.  Piensa formalizar su relacin de hogar con su actual pareja en Cartago, no tiene inconvenientes  con el transporte ya que tiene moto. Candidato elegible  que iniciar su proceso y trmites de vinculacin.', 100, 1),
(195, 'dice nunca haber vivido con su mam siempre ha  vivido con su abuela y bisabuela. Es una persona que no ha tenido mucha estabilidad laboral dice que por el tipo de empresas donde no le han ofrecido esa estabilida y ya quiere poder vincularse a un tipo de empresa que si se la ofrezca as como toda la parte de prestaciones sociales.  Se la habla de condiciones laborales, sueldo, horarios de alimentacion, horarios laborales, cumplimiento de programaciones, reubicaciones de personal en planta, utilizacion de EPP, justificacion de ausencias, no uso de celulares. Dice estar motivado y con condiciones muy adecuadas para conectarse al grupo de trabajo. ', 101, 6),
(196, 'Candidato que rene las caractersticas del perfil del cargo requerido, ha tenido cierta experiencia en armado. esqueletado de muebles, denot buena actitud y ganas de vincularse  a la empresa que le brinde estabilidad laboral y seguridad social. Iniciar  los trmites de vinculacin y los exmenes mdicos clnicos.', 101, 1),
(197, 'SE MOTIVO MUCHO EN LA ENTREVISTA CUANDO SE LE EXPUSO LOS HORARIOS LABORALES, EL TIPO DE PAGO CON PRESTACIONES SOCIALES. QUIERE TENER ESTA OPORTUNIDAD LABORAL,SE LE HABLO SOBRE LOS FLUJOS DE TRABAJO, CUMPLIMIENTO DE PROGRAMACIONES, USO DE EPP, NO USO DE ELEMENTOS COMO ACCESORIOS Y CELULARES. SE LE EXPUSO QUE ES MUY IMPORTANTE LA ESTABILIDAD LABORAL Y NO NOS INTERESABA UNA CAPACITACION PARA 1 MES O 2 MESES DE TRABAJO. DICE QUE EL QUIERE TRABAJAR BASTANTE TIEMPO. ACA VIVE CON SU HERMANO PORQUE SUS FAMILIARES VIVEN EN QUINCHIA. ', 102, 6),
(198, 'Candidato con buena actitud , muchas  ganas y gran disposicin para vincularse con la empresa. Tiene una buena formacin tcnica, buena preparacin fsica - deportiva, pag servicio militar, vive con el hermano mayor, desea seguir superndose acadmicamente y estabilizarse en una empresa que le brinde estabilidad laboral, seguridad social y prestaciones sociales. ELEGIBLE  e iniciar  proceso y trmites de vinculacin.', 102, 1),
(199, 'el papa vive ac en Pereira en la casa de la hermana, la mama vive en Mesitas del Colegio por Bogot. Nilson es de Bogot vive por ac desde 2019. Tiene 3 hermanos el mayor de 34 aos y vive en Bogot es vendedor independiente, tiene el hermano de 26 aos y la hermana trabaja como vendedora en Kolors.  ', 104, 6),
(200, 'Candidato con buena actitud y disposicin para el cargo ofrecido, denot inters y ganas de vincularse , ELEGIBLE, iniciar trmites de vinculacin y realizacin de exmenes mdicos clnicos.', 104, 1),
(201, 'es una persona con un buen perfil, se adapta a las necesidades de la empresa y quiere aprender y contribuir a la empresa en lo que se requiera. Se le hablo de la extensin de la practica en que estara relacionada, una parte documental con actualizacion en listas de materiales y rutas de manufactura, documentacion de capacitaciones en nexus y otra parte practica en planta de produccin con tiempos anlisis de operaciones y listas de chequeo.', 103, 6),
(202, 'es una persona con una personalidad espontnea. En la entrevista llam la atencin su presentacin personal y la cantidad de tatuajes que tiene en su cuerpo, tambin su peso corporal. Tambin llam la atencin la causa de salida de la empresa anterior donde expuso que haba sido ocasionado por sus desrdenes econmicos que la llevaron a renunciar para optar a la liquidacin.  Se le hizo la prueba en costura y las operaciones no fueron desarrolladas con tanta rapidez pero si con propiedad en el manejo de las mquinas. Se enva para exmenes mdicos.', 105, 6),
(203, 'es una persona joven y se puede moldear fcilmente a las expectativas y necesidad de la empresa. Expuso que no tiene mucha experiencia en el manejo de maquinas de costura solo eventualmente cuando le ha ayudado a su papa en el taller que el tiene. No tiene problemas con los horarios laborales y el tipo de tarea a desempear. Se le hizo la prueba en costura pero el resultado no fu muy satisfactorio ya que como ella dice solo eventualmente lo habia hecho. ', 107, 6),
(204, 'es un muchacho con un buen perfil, se le hacen las observaciones del caso respecto al tipo de empresa, actividades a desarrollar, horarios de trabajo, tramite con los permisos medicos y personales.\nSe le habla de la ubicacin de personal estratgicamente para nivelacin  de procesos. Puede adaptarse a la seccin de tapiceria.\n', 106, 6),
(205, 'tiene un buen perfil y se le ve potencial para ubicar en la seccin de mquinas. Se ve una persona seria y disciplinada. Se la habla de los horarios laborales, la gestin de permisos personales los fines de semana, el uso de EPP, el no uso de telfonos celulares en horarios laborales. Se le habla de la reubicacin en planta para nivelar flujos de trabajo.', 109, 6),
(206, 'Candidato que super la entrevista presencial con buenos conceptos de quin le entrevist , aparte que telefnicamente haba transmitido seguridad en inters de vincularse. Elegible  e iniciar trmites de documentacin y exmenes mdicos clnicos para su proceso de vinculacin .', 109, 1),
(207, 'le fue muy bien en la prueba, sac de manera adecuada la muestra con curva y repisado, lo trabaj en un buen tiempo. Domina el manejo de la mquina plana. Me llam la atencin en la entrevista que para ella es muy llamativo el horario laboral porque dice que el sbado y el domingo realmente podra aprovechar este tiempo de calidad con sus hijos ya que dice que mientras ha trabajado como independiente realmente no les ha podido dedicar tiempo. Su hijo mayor sufre sndrome de Asperger ( autismo). Se la hace la observacin que no puede utilizar accesorios, cadenas relojes o piercing ( tiene uno en la nariz), no puede utilizar telfonos celulares en tiempo laborales, se le habla sobre la gestin de permisos personales en horarios sbados, sobre el control de produccin por da y por hora. ', 110, 6),
(208, 'Costurera que aplica para el cargo, super la entrevista presencial y la prueba de costura, adems haba una buena percepcin de la comunicacin verbal telefnica de la  aspirante, por lo tanto , es viable su ingreso, iniciar trmites y exmenes mdicos clnicos . Elegible.', 110, 1),
(209, 'Candidata que super la prueba tcnica y la entrevista presencial , aparte que en la comunicacin telefnica dbito mucho inters y buena actitud, SIN EMBARGO,  NO CALIFIC SATISFACTORIAMENTE LOS EXMENES MDICOS CLINICOS, NO ELEGIBLE ', 105, 1),
(210, 'Candidato que super la entrevista presencial , y previamente ense una imagen de compromiso y responsabilidad, pero al ser convocado para iniciar trmites, NO MOSTR \nNADA INTERS , DESISTI VOLUNTARIAMENTE, DESCARTADO ABSOLUTAMENTE.', 106, 1),
(211, 'tiene dos hermanas mas y Ricardo, los paps son divorciados pero hace mucho tiempo no lo ve. Una hermana es operaria en Coitex hace 13 aos y el otro hermana es ebanista hace los mismo que Ricardo trabaja por la badea. Ricardo es pintor ac en Muebles Albura. Se le hizo prueba y fu adecuada al principio un embono le qued torcido pero despus con una explicacin, sac el otro mejor.  Se ve una persona que se deja ensear y no es prepotente. Se la hacen las observaciones al respecto sobre uso de EPP, no uso de celulares y accesorios en planta. Se le cuenta sobre los horarios laborales, las programaciones de produccion y la rotacion ocasional de centros de trabajo para nivelar procesos. ', 112, 6),
(212, 'Candidata referida por el pintor Ricardo, super la prueba de costura y denot buena actitud y mucho inters para vincularse con la empresa. Iniciar trmites de vinculacin y exmenes mdicos clnicos. Elegible.', 112, 1),
(213, 'el papa es constructor, la mama es ama de casa el hermano mayor tiene 33 aos y trabaja en olmpica es despostador y el hermano menor tiene 18 aos es mas perezoso y no quiere despegar ya termin el colegio. Viven en Frailes, el hermano mayor vive en la Florida. Se le ve un buen aptitud, sinergia, contagia una buena energa. Se le habla sobre el procedimiento de permisos y operaciones  a realizar en el proceso. Dice no tener problemas con su hijo en el estudio ya que inicia a estudiar a las 6 am y en la tarde se queda con la mama. ', 113, 6),
(214, 'Candidata conocida por la vecina  Sra. Alix Ortiz ( Wra. Empaque) , denot versatilidad y adaptabilidad al cargo de costurera, tiene la experiencia y la habilidad, candidata Elegible e iniciar proceso de vinculacin para la documentacin y exmenes mdicos clnicos. ', 113, 1),
(215, 'tiene muy buena aptitud, que contagia energa positiva. Se nota una persona muy responsable y con unos objetivos muy firmes. Se hizo prueba en mquina plana de embono y somier para mirar las puntas curvas. El lder de procesa retroalimenta que fue positiva la sac a cabalidad y de manera satisfactoria, estaba un poco nerviosa sin embargo se le  vi propiedad en el manejo de la mquina. Se la habla sobre el manejo de permisos personales, horarios de trabajo, uso de EPP, correcto manejo de celulares, no uso de elementos y accesorios como cadenas, aretes y dems. se le habla sobre la asignacin de tareas. ', 114, 6),
(216, 'Candidata que super la prueba tcnica de costura, denot en la entrevista presencial , inters y deseos de vincularse a la empresa  por aspectos de estabilidad laboral y seguridad social. Elegible, empezar trmites de vinculacin y realizacin de exmenes mdicos clnicos.', 114, 1),
(218, 'Su Madre falleci hace aproximadamente 4 aos, tiene 2 hermanos que viven en el barrio los Reyes D/das (1 hermano que es sordomudo y 1 hermana). \nSu experiencia laboral como almacenista y formacin acadmica en tecnologa industrial de la UTP se ajusta a lo requerido por el cargo, tuvo una muy buena actitud en la entrevista e inters en la vacante. \nSe la hace la observacin del uso adecuado del telfono celular en tiempo laboral, se le habla sobre la gestin de permisos personales para los das sbados y le interesa mucho trabajar en la empresa en los horarios actuales que tenemos con jornadas flexibles debido a que los sbados el lleva a su hijo a entrenar futbol y tambin entrena ciclismo.', 116, 8),
(219, 'Candidato que pas por la empresa unos aos atrs, form parde la Organizacin, trabajando en Proveedura. Auditora, Publiprint. Se distingui por ser un trabajador recursivo, eficiente, ordenado y comprometido.  Se adapta a las necesidades de la empresa y a las condiciones laborales ofrecidas. Elegible para empezar trmites de ingreso y exmenes mdicos clnicos. ', 116, 1),
