(290, 'Aspirante de condicin soltera, vive aparte paga arriendo, tiene una relacin d e noviazgo ms de 5 aos. Experiencia en Call Center, buena fluidez verbal, recursiva , sabe recurrir objeciones. Su debilidad no ha vendido productos del sector de muebles y colchones. Denot buena actitud y mucho inters', 149, 2),
