(298, 'Se le llam en horas de la maana del da 28 de enero de 2023, para convocarla a proceso de  trmites de vinculacin y manifest que ya tena otra oferta  laboral y que la nuestra ya no estaba en sus planes. Desisti del proceso.', 148, 1),
