(886, 'Es un cotejo que se hace entre los dineros que han ingresado y salido de la caja (con su respectivo soporte) en un periodo de tiempo y la informacion que est registrada en el sistema, la cual debe ser igual, validando fsicamente todos y cada uno de los documentos que soportan los movimientos ,  el resultado final nos arroja si la caja  tiene sobrante o faltante.', '', '', '5', '2023-02-23', 406, 255),
