(2176, 'CUANDO EL PRODUCTO VA PINTADO DE COLOR BLANCO O NEGRO.', '', '', '5', '2023-10-02', 847, 1388),
(2177, 'CONTROL DE REGISTRO RG-PRD-08 (CONTROL DE ORDENES DE PRODUCCION EN PROCESO)', '', '', '5', '2023-10-02', 847, 1384),
(2178, 'No debemos dejar pasar productos que tengan la estructura dispareja o grapas salidas o productos frescos o que tengan chirreos.', '', '', '5', '2023-10-02', 847, 1386),
(2179, 'No debemos dejar pasar productos mal detallados ', '', '', '4', '2023-10-02', 847, 1387),
(2180, 'Para la liberacin del producto por parte de cada operario el procedimiento es mediante el stiker/troquel de liberacin de producto (RG-PRD-27 LISTADO DE MARCACIONES )a conformidad de los parmetros establecidos por calidad', '', '', '5', '2023-10-02', 847, 1385),
(2181, 'El control de calidad para maquinado es el seguimiento detallado por cada maquina por donde pasa cada  producto en  donde cada operario y el lder deben velar el cumplimiento de las especificaciones de este,  apoyndose con las listas de chequeo.', '', '', '5', '2023-10-02', 846, 1379),
(2182, 'Se maneja (FO-PRD-22 INSPECCION DE PIEZAS EN MAQUINAS) (EP-PRD-01 ESPECIFICACIONES DE PRODUCTO MADERA)(EP-PRD-04 ESPECIFICACIONES DE PRODUCTO TAPICERIA)(PL-PRD-01 PLANOS TECNICOS DEL PRODUCTO) (PL-PRD-10 PLANOS TECNICOS DE BOCELES) Y ESPECIFICACIONES DE SIERRA VERTICAL', '', '', '5', '2023-10-02', 846, 1380),
(2183, 'El objetivo no es mantener un puesto de trabajo bonito , sino trabajar de forma mas eficiente, mejorando la calidad , se evitan confusiones y se detectan anomalas rpidamente , se minimiza las averas e incidencias internas, adems  se obtiene mejoras en la prevencin de riesgos laborales y aumenta la motivacin al trabajar en un eterno mas agradable.', '', '', '5', '2023-10-02', 846, 1381),
(2184, 'El porcentaje de humedad de la madera debe ser aproximadamente del 15 para poder que siga al proceso de transformacin o a ensamble.', '', '', '5', '2023-10-02', 846, 1382),
(2185, 'No se debe dejar pasar producto mal maquinados que no cumplan con los planos tcnicos o especificaciones , melaminas despicadas o mal enchapadas , humedades  en las maderas  no mayores al 15 ', '', '', '5', '2023-10-02', 846, 1383),
(2186, 'Los elementos de entrada y desarrollo se realiza mediante una investigacin de productos en el mercado que cumplan o sean semejantes  a las exigencias y requisitos presentados por el comit Presidencial  y una vez se haya realizado dicha investigacin y se tengan varias alternativas, la jefe de diseo y calidad  deber escoger una propuesta mas idnea y plasmar un diseo  para el desarrollo del nuevo producto con base a la investigacin. ', '', '', '5', '2023-10-02', 844, 1317),
(2187, 'Cuando se tiene identificado y plasmado el diseo, se deber identificar y desglosar el producto diseado, especificando las piezas y los parmetros para su construccin, teniendo en cuenta el impacto y caractersticas de trabajo en cada una de las secciones, tambin se debe tener en cuenta sus propiedades y medidas adems los herrajes y los accesorios que tendr como componente el producto.', '', '', '5', '2023-10-02', 844, 1318),
(2188, 'Una vez se tenga el diseo con todas las especificaciones del producto se le informa al jefe de producto para que de inicio a la fabricacin de la prueba piloto teniendo en cuenta ( PD-PRD-05 a PD-PRD-10) ', '', '', '5', '2023-10-02', 844, 1319);
INSERT INTO `respuestas_evaluaciones_usuario` (`id_respuesta`, `respuesta_user`, `url_archivo`, `tipo_archivo`, `nota_pregunta`, `fecha_respuesta`, `id_union_usuario`, `id_pregunta_ev`) VALUES
(2189, 'Anlisis de la materia prima, Anlisis mano de obra e indirectos, Resistencia del producto, Ergonoma del producto, Funcionalidad de los herrajes, Consumo de las materia primas e insumos, Costos de fabricacin.', '', '', '5', '2023-10-02', 844, 1320),
(2190, 'El comit Presidencial determinara la viabilidad y conclusiones del producto para determinar si es aprobado o no, teniendo en cuenta las pruebas realizadas y las etapas del Diseo y construccin del prototipo.', '', '', '5', '2023-10-02', 844, 1321),
(2191, 'Espesores: 3,4,6,9,12,15,18,25,30,36 mm y Formatos  1,22*244 - 1,52*2,44 - 1,83*2,44 - 2,15*2,44', '', '', '5', '2023-10-02', 845, 1373),
(2192, 'A', '', '', '5', '2023-10-02', 845, 1374),
(2193, 'Se necesita: Tipo de mueble, Dimensiones del espacio y del mueble, Tableros a utilizar, Diseo y estilo del mueble, Elementos que se almacenen en el mueble, Consideraciones ergonmicas y antropomtricas, Herrajes y accesorios y presupuesto tener en cuenta en escuchar al cliente para saber sus necesidades.', '', '', '5', '2023-10-02', 845, 1375),
(2194, 'Es el resultado de transformar un simple cubo en una estructura mas compleja y funcional.', '', '', '5', '2023-10-02', 845, 1376),
(2195, 'Se debe descontar 3mm en un lado largo y en un lado ancho.', '', '', '5', '2023-10-02', 845, 1377),
(2196, 'El ancho del cajn de la gaveta es el resultado de la medida interna del caso menos 26mm que es el grosor del riel.', '', '', '5', '2023-10-02', 845, 1378),
(2197, 'Ensamble a topo y clavo, con grapa metlica, con escuadra metlica, con cargador, a media madera por canto y cabeza, con rebajo o canal, con caja y espiga, con lazo recto, con ngulo recto con caja abierta, con cola de milano, en cruz a media madera, con lengeta-perno y pegamento, con alargamiento y empalme. ', '', '', '5', '2023-10-02', 848, 1308),
(2198, 'Los ensambles en forma de T se hacen mas rpido utilizando grapas de metal que normalmente se encuentran afiladas por un extremo', '', '', '5', '2023-10-02', 848, 1309),
(2199, 'Consiste en que el listn deber tener un corte seccionado por cara  ala mitad  del espesor y hacerse una caja en el otro listn por el lado del canto , as ambas piezas quedaran apaadas a una cara y no sobresaldr ninguna parte de los listones de madera.', '', '', '5', '2023-10-02', 848, 1310),
(2200, 'Los tipos de ensamble con caja y espiga son: Caja y espiga simple, Caja con medio rebajo y espiga con taln, Caja y espiga doble, Caja con espiga y pernos, Caja con espiga integrada y espiga doble, ', '', '', '5', '2023-10-02', 848, 1311),
