(55, 1, 'si , en casa azul , muebles BL , cocinas integrales ', 11),
(56, 2, '10', 11),
(67, 13, '60 min', 11),
(68, 14, 'Es una persona con amplio conocimiento en el tema de aplicacin y manejo de equipos , tiene buena tcnica de aplicacin , no muequea y mantiene una buena linea secuencial al momento de trabajar una superficie grande a fin de que no le quede fogueado . El terminado del producto no fue el esperado ya que desde que empez la prueba manifest que la posicin de la cubierta no era la adecuada para obtener un buen resultado , sin embargo con un solo retoque se pudo liberar la unidad.', 11),
(69, 15, 'BUENO', 11),
(70, 16, 'BUENO', 11),
(71, 17, 'BUENO', 11),
(72, 18, 'BUENO', 11),
(73, 19, 'BUENO', 11),
(74, 20, 'Se ve que tiene conocimiento del proceso ,hizo buenas sugerencias en cuanto al funcionamiento de la cabina y comparti situaciones importantes de acuerdo a sus anteriores experiencias ,las cuales nos pueden ayudar a fortalecer algunas debilidades que tenemos en el proceso . ', 11),
(75, 21, 'SI', 11),
(121, 14, 'No tiene experiencia en el manejo de equipos de alta y por esta razn se le adecuo el equipo , este seria un punto a trabajar en caso de ser contratado pero no es una barrera ya que por la experiencia que tiene se puede acoplar fcilmente a los equipos , tiene buena linea de aplicacin , sabe manejar bien la pistola , no muequea , aplica  con buena distancia entre el pico de la pistola y el producto a pintar . \r\nSe reviso el producto y tiene un buen terminado ( sin fogueo , sin piel de naranja , solo se goteo la parte donde entra la cava pero no es visible  . En trminos generales supero la prueba .', 15),
(120, 13, '30 minutos ', 15),
