(28, 'REALIZADO', 'bg-success', '5.6', '1.12', 'Se resalta en el que es una persona atenta que toma bien las instrucciones y asignaciones de actividades en la seccin, es responsable pero debe mejorar de una forma mas enftica la parte de tiempos en los procesos de produccin, es muy pasivo y poco dinmico y es algo que debe tener para que los objetivos del proceso se cumplan a cabalidad. ', 'SUPERA LO ESPERADO', 1004681711, 0, 0, 26, 26),
(31, 'REALIZADO', 'bg-success', '4.3', '0.86', 'ninguna', 'CUMPLE CON LO ESPERADO', 1088039400, 0, 0, 193, 29),
(30, 'REALIZADO', 'bg-success', '6.3', '1.26', 'Ninguna', 'SUPERA LO ESPERADO', 1088039400, 0, 0, 193, 28),
(32, 'REALIZADO', 'bg-success', '4.6', '0.92', 'Es una persona educada, comprometida y responsable; en el proceso de costos se  le ha visto una gran mejora, siempre es presto a escuchar las retroalimentaciones de su jefe inmediato, sin embargo es demasiado pasivo en los seguimiento correspondientes a sus funciones, debe de revisar herramientas que le ayuden a recordar los procesos que son espordicos, trabajar en ser ms proactivo debido a que dilata mucho los procesos y mejorar la comunicacin con la comunicacin con los Jefes de la Fabrica, debe evitar suponer para evitar reprocesos.', 'CUMPLE CON LO ESPERADO', 1088017408, 0, 0, 9, 30),
(33, 'REALIZADO', 'bg-success', '4.8', '0.96', '', 'SUPERA LO ESPERADO', 1004681711, 0, 0, 52, 31),
(34, 'REALIZADO', 'bg-success', '4.8', '0.96', 'MUY BUENA EFECTIVIDAD CON LAS TAREAS ASIGNADAS, TAMBIEN INTERPRETA Y AJUSTA BIEN MEDIDAS Y ESCUADRAS A LA HORA DE LOS ENSAMBLES. ', 'SUPERA LO ESPERADO', 1004681711, 0, 0, 68, 31),
(35, 'REALIZADO', 'bg-success', '4.9', '0.98', '', 'SUPERA LO ESPERADO', 1004681711, 0, 0, 71, 31),
(36, 'REALIZADO', 'bg-success', '4.7', '0.94', 'BUEN CONOCIMIENTO CON RESPECTO A LAS SERIES QUE SE ELABORAN Y BUEN APOYO PARA AYUDAS E INCONVENIENTES QUE SURGAN EN LOS PROCESOS', 'CUMPLE CON LO ESPERADO', 1004681711, 0, 0, 23, 32),
(37, 'REALIZADO', 'bg-success', '4.7', '0.94', 'MUY AGIL A LA HORA DE ARMADO Y DETALLADO ', 'CUMPLE CON LO ESPERADO', 1004681711, 0, 0, 32, 32),
(38, 'REALIZADO', 'bg-success', '4.8', '0.96', '', 'SUPERA LO ESPERADO', 1004681711, 0, 0, 70, 32),
(39, 'REALIZADO', 'bg-success', '4.9', '0.98', '', 'SUPERA LO ESPERADO', 1004681711, 0, 0, 74, 32),
(40, 'REALIZADO', 'bg-success', '4.4', '0.88', 'ES AGIL, EFICAZ Y CUIDADOSO CON RESPECTO A LAS TAREAS Y A SUS ASIGNACIONES. ', 'CUMPLE CON LO ESPERADO', 1004681711, 0, 0, 206, 32),
(41, 'REALIZADO', 'bg-success', '4.6', '0.92', 'Debe mejorar en proponer acciones para el mejoramiento continuo de los procesos frente a producto y metodologas de trabajo. Participar conjuntamente con los jefes de Procesos en la planeacin estratgica y acciones de mejoras de la empresa a fin de lograr un mejoramiento continuo.', 'CUMPLE CON LO ESPERADO', 1087991335, 0, 0, 10, 33),
(42, 'REALIZADO', 'bg-success', '4.5', '0.9', 'German es una persona comprometida y organizada. Comunica activamente novedades acerca de la materia prima. Suministra informacin confiable y oportuna.  La idea es fortalecer mas el proceso de liderazgo, manejo de equipos. Debe fortalecer mas aspectos del SGC como las inspecciones, el procedimiento de PNC y las biblias de produccin. ', 'CUMPLE CON LO ESPERADO', 42150928, 0, 0, 50, 34),
(43, 'REALIZADO', 'bg-success', '4.5', '0.9', 'Jaime Silva es un lder del proceso con orientacin a resultados. Imparte disciplina y responbilidad en el trabajo. Es una persona con mucha tica y amor a la empresa. Tiene excelentes ideas en pro de la mejora del proceso. Con el grupo de trabajo que direcciona se comunica asertivamente aunque en el trabajo en equipo con sus pares se le ha dificultado la comunicacin. El trabajo bajo presin lo estresa y puede actuar impulsivamente. ', 'CUMPLE CON LO ESPERADO', 42150928, 0, 0, 62, 35),
(44, 'REALIZADO', 'bg-success', '4.7', '0.94', 'Gustavo es un lder de proceso empoderado de sus funciones, con conocimiento pleno en el proceso de produccin, con experiencia en la fabricacin de producto y asignacin de tareas segn los recursos disponibles. Cuenta con empata y tiene una visin general del proceso. Debemos pensar en documentar mas el proceso soportar el conocimiento en capacitaciones de Nexus y trabajar mas al da con el SGC. Participa activamente en planes de mejora.', 'CUMPLE CON LO ESPERADO', 42150928, 0, 0, 7, 36),
