(59, 'REALIZADO', 'bg-success', '4.1', '0.82', 'Don Alberto es una persona que lleva trabajando muchos aos con nosotros con responsabilidad, integridad y moldendose a las necesidades de la empresa. En algunas situaciones hemos visto las consecuencias de la ausencia de verificacin en el acondicionamiento y empaque de algunos productos, con responsabilidad grupal no individual. Conoce los productos e identifica las necesidades del empaque de manera autnoma. ', 'CUMPLE CON LO ESPERADO', 42150928, 0, 0, 79, 45),
(60, 'REALIZADO', 'bg-success', '4.5', '0.9', 'Doa Alix es una colaboradora de la empresa excelente quien maneja de manera autnoma las actividades en el proceso. Analiza la forma de empaque de los productos nuevos y existentes. Optimiza el uso de  los recursos del subproceso y fomenta la reutilizacin de materia prima. Se preocupa por el plan de trabajo y constantemente esta evaluando su desarrollo. En la actividad no se tiene una programacin diaria de acuerdo al plan  general de produccin pero esta pendiente de la necesidad de sus clientes internos. ', 'CUMPLE CON LO ESPERADO', 42150928, 0, 0, 19, 46),
(61, 'REALIZADO', 'bg-success', '1.4', '0.28', 'hay una comunicacin bloqueada en el proceso. Est ajeno a los planes de produccin.', 'NO CUMPLE CON LO ESPERADO', 42150928, 0, 0, 77, 47),
(62, 'REALIZADO', 'bg-success', '4.9', '0.98', 'Buen elemento por su actitud para el trabajo y sacar adelante las actividades que se le asignan', 'SUPERA LO ESPERADO', 10108298, 0, 0, 41, 48),
(63, 'REALIZADO', 'bg-success', '4.8', '0.96', 'me toca dejarlo a que comience a tomar decisiones proyectndolo hacia esta responsabilidad', 'SUPERA LO ESPERADO', 10108298, 0, 0, 194, 49),
(64, 'REALIZADO', 'bg-success', '4.1', '0.82', 'toma con gusto cualquier critica  para la mejora de sus actividades, solo que debe de tratar mucho mejor las maquinas, que le ayudan a ejecutar sus actividades.', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 47, 50),
(65, 'SIN REALIZAR', 'bg-danger', NULL, NULL, NULL, NULL, 0, 0, 0, 49, 50),
(66, 'REALIZADO', 'bg-success', '4.5', '0.9', 'ES UN OPERARIO MUY EFICIENTE, PERO ES COMPLICADA LA COMUNICACION CON SUS COMPAEROS, YA QUE TOMA UNA ACTITUD MUY GROSERA O NO LES CONTESTA ', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 53, 50),
(67, 'REALIZADO', 'bg-success', '4.7', '0.94', 'ES UNA PERSONA MUY AJIL, PERO DE SUS ARRERAS AVECES NO PONER CUIDADO AL ESTADO DEL MATERIAL, Y SE LE PASA LO MALO.', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 89, 50),
(68, 'REALIZADO', 'bg-success', '4.7', '0.94', '', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 96, 50),
(69, 'REALIZADO', 'bg-success', '4.7', '0.94', 'ES UNA PERSONA QUE HA DEMOSTRADO EL INTERES POR APRENDER TODA OPERACION, MANEJO DE MAQUINA, QUE CONLLEVE AL CUMPLIMIENTO DE LAS METAS, ES MUY ACTIVO, ACATA Y APRENDE CON FACILIDAD.', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 200, 50),
(70, 'REALIZADO', 'bg-success', '3.8', '0.76', 'ES DEMACIADO COMPLICADO RERIGIRSE A EL, ES DEMACIADO ALTANERO, GROSERO, MANTIEN A LA DEFENCIVA DE LO QUE SE VALLA A DECIR, A TODO LE ENCUENTRA UN PERO Y SIEMPRE ESTA EN DESACUERDO, NO SE NETIENDE PARA TRABAJO EN EQUIPO YA QUE QUIERE TENER LA RAZON PARA TODO Y NO ESCUCHA A NADIE.', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 24, 51),
(71, 'REALIZADO', 'bg-success', '4.7', '0.94', 'EXCELENTE  ACTITUD Y DISPONIBILIDAD PARA LAS TAREAS QUE SE LE ASIGNEN, ES UN BUEN APOYO DE SUS  COMPAEROS CUANDO SE LES GENERAN DUDAS, LAS ACLARA Y  SI NO TIENE CONOCIMIENTO BUSCA LA PERSONA A DECUADA PARA ACLARARLA TANTO A EL COMO AL COMPAERO, EXCELENTE PRA TRABAJAR EN EQUIPO.', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 25, 51),
(72, 'REALIZADO', 'bg-success', '4.4', '0.88', 'SE LE A RETROALIMETADO EN VARIAS OCACIONES EN LA RADIAL # 2 LA MALA ESCUADRA, CON EL PROBLEMA DE LA MAQUINA SE MANEJA UNA TOLERANCA, LA CUAL SE DEBE DE ESTAR REVISANDO Y HACER EL CORTE DE TABLA DE MAXIMO DOS, YA QUE POR LA FALTA DE CUIDADO Y NO PRECATAR LAS INDICACIONES , SE GENERA VARIOS REPROCESOS TANTO EN LA VERIFICACION EN LA SECCION TANTO COMO  EN EL AREA DE ENSAMBLE, SE A PERCATADO QUE LAS INDICACIONES NO SE HAN IMPLEMENTADO YA QUE SE SIGUE PRESENTADO LA PROBLEMATICA', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 30, 51),
(73, 'REALIZADO', 'bg-success', '4.5', '0.9', 'ES UN BUEN OPERARIO EN LAS ACTIVIDADES QUE SE LE ASIGNEN, FALTA DE AGILIDAD AVECES POR SUS INSEGURIDADES, Y CUANDO SE LE HAGA UNA OBSERVACION AVECES LA DISCUTE DEMACIADO PARA ACEPTARLA.', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 39, 51),
(74, 'REALIZADO', 'bg-success', '4.6', '0.92', 'EXCELENTE OPERARIO,  BUENA ACTITUD AL RECIBIR INDICACIONES, BUENA CALIDAD EN LO QUE HACE, BUENA DISPONIBLIDAD PARA APOYAR EN OTRAS MAQUINAS PARA EL CUMPLIMINETO DE LAS METAS, BUENAS ESCUCHA PARA DAR PRIORIDADES A LOS QUE SE NECERITA EN PLANTA.', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 42, 51),
(75, 'REALIZADO', 'bg-success', '4.4', '0.88', 'NO PREGUNTA CUANDO TIENE DUDAS AL SUPERVISOR, SOLO ACUDE A LOS MISMO OPERARIOS Y TOMA DECISIONES ENTRE ELLOS, SE HAN PRESENTADO VARIOS INCONVENIENTES POR ESTA PROBLEMATICA, YA QUE LE HA DICHO EN VARIAS OCACIONES COMO DEBE SER EL CONDUCTO REGULAR CUANDO TIENE ALGUN PROBLEMA O DUDA, EN  MUCHAS OCACIONES NO RETALEA LAS PIEZAS QUE SE DEBEN HACER Y DESAJUNTA OTRAS SERIES PARA SU FACILIDAD Y COMODIDAD.', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 67, 51),
(76, 'REALIZADO', 'bg-success', '4.6', '0.92', 'EXCELNTE ACTITUD PARA RECIBIR INFORMACION Y CRITICAS PARA MEJORAS, SIEMPRE ESTA EN BUSQUEDA DE ALGO QUE HACER CUANDO CUMPLE SUS TAREAS Y EL SUPERVISOR NO ESTA EN EL MOMENTO. BUENAS DISPONIBLIDAD PARA AJECUTAR OTRAS TAREAS ASIGNADAS ', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 69, 51),
(77, 'REALIZADO', 'bg-success', '4.6', '0.92', 'EXCELENTE ACTITUD EN SUS ACTIVIDADES ASIGNADAS, EN DAR CAPACITACION EN EL AMANEJO DE LAS MAQUINAS A OPERERIOS NUEVOS, Y ESTA MUY PENDIENTE DE QUE ANTES DE MANIPULAR ALGUNA MAQUINA, TENGA SU INDUCCION Y LAS ESPECIFICACIONES DE LA MAQUINA FIRMADAS', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 80, 51),
(78, 'REALIZADO', 'bg-success', '4.5', '0.9', 'CUANDO LE ESTE DANDO EL TRABAJO FINAL A LA PIEZA FIJARSE MAS EN LA ORDEN DE PRODUCCION Y OBSERVAR QUE ESPECIFICACIONES O CONDICIONES TRAE, YA QUE SE RETALE MUCHO Y PASA PIEZAS QUE NO CUMPLEN CON LAS ESPECIFICACIONES. COMO LARGO FINAL, CALIDA DE LA MADERA, CEPILLADOS, ENTRE OTROS', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 86, 51),
(79, 'REALIZADO', 'bg-success', '4.6', '0.92', 'EXCELENTE DISPONIBILIDAD PARA ACEPTAR TAREAS Y  APOYAR EN OTRAS MAQUINAS PARA EL CUMPLIMIENTO DE LAS METAS PROPUESTAS. ', 'CUMPLE CON LO ESPERADO', 1088305288, 0, 0, 91, 51),
(80, 'REALIZADO', 'bg-success', '4.4', '0.88', '', 'CUMPLE CON LO ESPERADO', 98668065, 0, 0, 4, 52),
