(82, 'REALIZADO', 'bg-success', '4.3', '0.86', 'Octavio es una persona altamente comprometida  con su trabajo. Me gustara ver un empoderamiento mayor  hacia  el manejo de equipo, planes de entrenamiento y desarrollo de su capacidad tcnica. Debe de mejorar  en la comunicacin con la gerencia no  haciendo uso de esta  para temas correctivos sino para planificaciones  y mejoras de procesos en el departamento,  a   niveles estratgicos que le generen una mayor eficiencia en su funcionamiento, desarrollando por iniciativa propia  planes de registro  y mejorar de los mantenimientos, vida til de maquinaria y desarrollo que nos permitan mejorar tiempos  productivos. ', 'CUMPLE CON LO ESPERADO', 9866805, 0, 0, 13, 54);
